INSERT INTO `fb_posts` VALUES (62, 14, 1, '', NULL, NULL, '玩儿梦想小镇有几个月了，看着自己的小镇一天天壮大真的很有成就感。很喜欢把小镇细节放大看每个居民和房屋的动效。赞美之词大家都说了很多我就不赘述了。虽然住宅建筑和社区建筑的功能是增加人口，对此我希望：1.让在道路上走的居民和社区建筑比如警察局，邮局，宾馆等这样静态的社区建筑有交互。居民可以进入社区建筑或者从社区建筑中出来，居民楼同理。这样我感觉会觉得整个小镇的互动性更逻辑性更连通的感觉。2.为社区建筑增加相应的迷你功能。在梦想小镇要完成的主要任务其实是生产，那么可不可以把与社区建筑相关的一些活动也加入进来？比如送信，或者帮人把衣服送到干洗店等等这样的迷你任务加入进来。主要任务肯定还是生产，但是如果加入零星的迷你任务会让我对新的社区建筑充满期待和好奇。因为现在社区建筑对于我而说越来越是完成人口数量的必备，而非为城市装饰的喜悦。相信这样的迷你任务会像游戏里每隔一段时间就举办的各种嵌有迷你小游戏的活动一样，另用户在玩游戏时口味更多，充满小惊喜，也更会是充满人情味的一款游戏～', '玩儿梦想小镇有几个月了，看着自己的小镇一天天壮大真的很有成就感。很喜欢把小镇细节放大看每个居民和房屋的动效。赞美之词大家都说了很多我就不赘述了。虽然住宅建筑和社区建筑的功能是增加人口，对此我希望：1.让在道路上走的居民和社区建筑比如警察局，邮局，宾馆等这样静态的社区建筑有交互。居民可以进入社区建筑或', '', 0, 1272, '2020-06-06 15:04:50', '2020-06-26 13:43:18', '2020-06-26 13:43:18', NULL);
INSERT INTO `fb_posts` VALUES (63, 14, 1, '', NULL, NULL, '#希望Journey能匹配到小伙伴\n首先说说游戏本身是有很大的耐玩性。这个游戏里面一开始是在茫茫的大沙漠里面，从目的地（其实就是那座山）飞过来一个流星，掉下来变成主角红袍。然后就是一路走一路吃星星增加围巾的长度。到第二关的时候遇到了一个小伙伴。然后继续走……最后会飞到山顶。走进光芒的时候，主角会变成那个流星，一路飞回去。最后又孤身一人，回到起点。 本来我是用PS4玩的这款游戏，后来在IPad上面看到了这个游戏之后（果断放弃PS4）😂还是熟悉的场景熟悉的红袍，可是没有小伙伴一起…？以为没有匹配到但是又试了几次还是没有（大哭）甚至我在选择关卡到第二关的时候都看见小伙伴在前面了，可是一过去就没了？神马情况？？？？请问是我的问题还是什么情况？不过还是希望陈星汉大大让我们在手机IPad上面也能匹配到小伙伴吧ヾ(´∀｀。ヾ)', '#希望Journey能匹配到小伙伴\n首先说说游戏本身是有很大的耐玩性。这个游戏里面一开始是在茫茫的大沙漠里面，从目的地（其实就是那座山）飞过来一个流星，掉下来变成主角红袍。然后就是一路走一路吃星星增加围巾的长度。到第二关的时候遇到了一个小伙伴。然后继续走……最后会飞到山顶。走进光芒的时候，主角会变成', '', 0, 405, '2020-06-07 10:40:26', '2020-06-22 14:30:03', '2020-06-22 14:30:03', NULL);
INSERT INTO `fb_posts` VALUES (64, 14, 1, '', NULL, NULL, '用了晒书房一下午的时间，整理了800多册图书📚使用下来的具体感受，最显著的支持多本图书连续扫一扫的功能。 ❤️❤️❤️具体感动我的几个优点😍： 1⃣️扫一扫ISBN码就能把图书信息全部录入，录入速度非常快捷； 还可以多本书连续扫，比一个个拿起来扫描快多了；如果重复录入也会自动提醒； 2⃣️可以自动为图书进行分类，还支持自建标签分类，方便分类和整理； 3⃣️可以导出并邮寄书单到个人的邮箱； 不过目前只有pdf的富文本格式，希望能够支持简单的excel或文本清单格式； 4⃣️查阅书目方便： 导入后可以通过名字或关键字搜索自己的同类书籍； ❤️几点小小的改进意见，希望有机会被斟酌和采纳： 1⃣️增加排序功能：比如根据标签类别排序，录入时间排序，书名排序，出版时间排序等等； 2⃣️增加自定义图书功能： 本人有些国外采购的外文数目, 无法录入； 3⃣️增加阅读视图：大图的浏览书目的窗口，一眼只能看到3～6本图书，对数目总数多多人来说，浏览效率不高； 4⃣️增加思维导图等内容整理，以及推荐什么类型的人阅读等功能，增加有权限等级分类下的内容分享功能； 喜欢这种坚持帮爱书之人收纳整理的App，愿意为以上意见及从此App中获得的帮助成为付费用户。感谢晒书房开发团队的努力～', '用了晒书房一下午的时间，整理了800多册图书📚使用下来的具体感受，最显著的支持多本图书连续扫一扫的功能。 ❤️❤️❤️具体感动我的几个优点😍： 1⃣️扫一扫ISBN码就能把图书信息全部录入，录入速度非常快捷； 还可以多本书连续扫，比一个个拿起来扫描快多了；如果重复录入也会自动提醒； 2⃣️可以自动为', '', 0, 403, '2020-06-07 10:43:18', '2020-06-22 14:29:58', '2020-06-22 14:29:58', NULL);
