INSERT INTO `fb_posts` VALUES (118, 27, 1, '', NULL, NULL, '#给Microsoft To Do一些建议\n1、增加日志簿选项，按日期显示过去每日完成的任务（参考Things） 2、对于显示已完成的任务，有一个明确的过期时间，比如每天或是三天，不然所有的已完成任务都显示在列表中会显得很乱。 3、开放页面背景自定义功能。 4、增加tags功能，有利于分类和搜索。 5、参考GTD思路，增加sometimes和anywhere或waiting for的分类（当前的任务相当于inbox）。', '#给Microsoft To Do一些建议\n1、增加日志簿选项，按日期显示过去每日完成的任务（参考Things） 2、对于显示已完成的任务，有一个明确的过期时间，比如每天或是三天，不然所有的已完成任务都显示在列表中会显得很乱。 3、开放页面背景自定义功能。 4、增加tags功能，有利于分类和搜索。 ', '', 0, 11196, '2020-06-15 12:52:44', '2020-08-20 12:09:54', NULL, NULL);
