INSERT INTO `fb_posts` VALUES (130, 39, 1, '', NULL, NULL, '求求石墨出iPad分屏功能吧，现在的浮窗真的不好使，顺便版面也可以改一下吗？具体： 1，横屏下版面左右空隙过大，字体大小却不会怎么变，本来是想横过来看的更清楚，结果和竖屏体验差不多，两边还巨大的白条条也没啥用，其他app的浮窗还会挡住文档界面，这大小挺尴尬的 2，不能分屏，写东西的时候想同步看看参考资料就会变得非常麻烦，切屏-看资料-切回来-写一段-切-看-切-写，后台开多了一不留神还会点错，真的影响使用体验。（如果可以分屏石墨就会成为我的主力工具，现在它还不行，就因为切屏太不方便 3，不能在其他app上浮窗显示，我想着不能分屏那开个浮窗也比切屏方便啊，第一条提了，其他app浮窗会档文档行不通，但是石墨自己又不能浮窗，唯有极其不方便的切屏一条路了。', '求求石墨出iPad分屏功能吧，现在的浮窗真的不好使，顺便版面也可以改一下吗？具体： 1，横屏下版面左右空隙过大，字体大小却不会怎么变，本来是想横过来看的更清楚，结果和竖屏体验差不多，两边还巨大的白条条也没啥用，其他app的浮窗还会挡住文档界面，这大小挺尴尬的 2，不能分屏，写东西的时候想同步看看参考', '', 0, 11098, '2020-06-16 17:51:35', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (131, 40, 1, '', NULL, NULL, '#Teambition的bug\n1、工作流状态任务，重复模式里的内容自动跳到第一步，不能选择重复到哪一步。不够人性化。 2、重复模式下，不能只显示今天未完成的任务吗？一定要长长的一堆任务哇 。3、重复模式下，今天评论的内容明天就不见了。别的软件都是留存的。4，比如每天要做的作业，昨天没完成，只能把昨天的点了完成才能做今天的，可是昨天的没有完成，点了完成不是就不真实了吗？ 5，已完成的任务能不能设置保存多少天？一直在下面，也太多了………… 6、设置了按开始时间最早看面板，然后要每次打开页面都要点，不能设置一次一直这样吗？总体感觉功能强大的同时，细节没有跟上……', '#Teambition的bug\n1、工作流状态任务，重复模式里的内容自动跳到第一步，不能选择重复到哪一步。不够人性化。 2、重复模式下，不能只显示今天未完成的任务吗？一定要长长的一堆任务哇 。3、重复模式下，今天评论的内容明天就不见了。别的软件都是留存的。4，比如每天要做的作业，昨天没完成，只能把昨', '', 0, 11092, '2020-06-16 17:56:17', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (132, 41, 1, '', NULL, NULL, '#喜欢Journey\n没能和另一个人一起完成这趟旅程，有点可惜，就好像人生一样，如果有一个人可以陪你完成整个人生的旅程就好了。 这款游戏和光遇的区别在于，光遇是为了点亮别人的，而这款游戏诉说的更多是升华自己。花那款游戏则是纯粹的心灵。 但无论如何，要怎么形容呢... 得要多么伟大的一颗心灵才能创造出这样的游戏啊。那么充盈的光和力量，我只好像信徒一样去仰望。 会一直一直喜欢下去的吧。', '#喜欢Journey\n没能和另一个人一起完成这趟旅程，有点可惜，就好像人生一样，如果有一个人可以陪你完成整个人生的旅程就好了。 这款游戏和光遇的区别在于，光遇是为了点亮别人的，而这款游戏诉说的更多是升华自己。花那款游戏则是纯粹的心灵。 但无论如何，要怎么形容呢... 得要多么伟大的一颗心灵才能创造出', '', 0, 11091, '2020-06-16 17:59:32', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (133, 42, 1, '', NULL, NULL, '我是个对app很挑的人，但对Recheck! 可以说是几秒钟下载，5分钟使用后即决定买下pro版！非常优秀的软件，因为找了好几个清单类软件，都尝试了，这款应该说是颜值加构思深深吸引了我，感觉是清单类里面别具一格的体会。也结合之前体验反馈几个想法给开发者，仅供参考，毕竟本心是希望软件越来越好： 1. 导入清单时候能否同时导入多个？现在当然也具有粘贴项目到别的清单，但使用我的模板时候同时勾选多个是否对用户来说更体贴？比如旅行清单 药物清单 女生旅行清单合并导入后十分实用。 2. 小组件目前展示了目录，可否指定展示清单数量或者内容。比如有些人可能在组件需要看到好几个清单，但有些人可能只需要常用2个清单，并且单个清单任务并不多，即使任务内容也展示在widget上完全不算太占地方，所以能不能第一，可以指定我只在组件展示指定清单，第二，可以选择是否展示清单下内容（因为比如我的工作待办为了更清楚，还在使用极简待办app，这样在widget上可以看到一条目一条目）；如果可以选择，本身就是对用户更精准分类和片杀类吸引。 3. 提醒可否对清单某任务假如位置出发到达提醒？还是我没找到，目前不少清单类软件都有。 另外一个问题是：可不可以以某种格式通过电脑编辑文本同步导入到某个清单啊……要是可以就完美了，毕竟电脑敲字还是慢啊哈哈，可就这样还是敲了一堆，希望开发者和该软件越来越好！', '我是个对app很挑的人，但对Recheck! 可以说是几秒钟下载，5分钟使用后即决定买下pro版！非常优秀的软件，因为找了好几个清单类软件，都尝试了，这款应该说是颜值加构思深深吸引了我，感觉是清单类里面别具一格的体会。也结合之前体验反馈几个想法给开发者，仅供参考，毕竟本心是希望软件越来越好： 1. ', '', 0, 11091, '2020-06-16 18:03:04', '2020-08-20 12:09:54', NULL, NULL);
