INSERT INTO `fb_posts` VALUES (136, 45, 1, '', NULL, NULL, '#新诛仙角色服装设计不够好 \n做一个资深的回合制玩家，站在眼高手低的角度上，我想吐槽一下这个游戏的人物造型，青云，天音，还有合欢，衣服几乎一样有没有，除了颜色不一样，新角色男的做的怪酷也怪帅！女的做的也很优美浪漫！这是我第一玩这个游戏，满怀期待的点开角色选择！每个角色的服装特色不一样的！结果点开我除了想选择云梦还有焚香！青云不够洒脱，合欢不够妩媚，天音不够温婉，鬼王不够鬼魅！个人意见，纯属吐槽，如果冒犯了，我真挚的道歉！', '#新诛仙角色服装设计不够好 \n做一个资深的回合制玩家，站在眼高手低的角度上，我想吐槽一下这个游戏的人物造型，青云，天音，还有合欢，衣服几乎一样有没有，除了颜色不一样，新角色男的做的怪酷也怪帅！女的做的也很优美浪漫！这是我第一玩这个游戏，满怀期待的点开角色选择！每个角色的服装特色不一样的！结果点开我除', '', 0, 11089, '2020-06-16 18:55:36', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (137, 45, 1, '', NULL, NULL, '#希望能被布魔方程序员GG看到\n导入图片进模型里只是简单的平铺吗 对上传图片的要求也太高了吧 就算用扫描扫描过了精修之后照片还是不可能跟实物一模一样 做出来的图片总是有很明显的接缝线 不确定优化一下吗？而且不能在做3d模型的时候导入图片吗 有时候做到一半发现忘记导入又要重新弄过 真的很麻烦', '#希望能被布魔方程序员GG看到\n导入图片进模型里只是简单的平铺吗 对上传图片的要求也太高了吧 就算用扫描扫描过了精修之后照片还是不可能跟实物一模一样 做出来的图片总是有很明显的接缝线 不确定优化一下吗？而且不能在做3d模型的时候导入图片吗 有时候做到一半发现忘记导入又要重新弄过 真的很麻烦', '', 0, 11088, '2020-06-16 19:02:03', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (138, 46, 1, '', NULL, NULL, '#FIMO超级好用但是最近更新之后老是闪退 \n更新以后我照不了照片了！一拍照就闪退，没有这个软件我怎么办啊！！求快点修复吧…… 好用是很好的但是最近更新之后老是闪退，以前都不会这样的！我特别喜欢用照食物的胶卷照啥都好看！刚刚更新了，依然有很严重的闪退问题，希望快点解决修复😭', '#FIMO超级好用但是最近更新之后老是闪退 \n更新以后我照不了照片了！一拍照就闪退，没有这个软件我怎么办啊！！求快点修复吧…… 好用是很好的但是最近更新之后老是闪退，以前都不会这样的！我特别喜欢用照食物的胶卷照啥都好看！刚刚更新了，依然有很严重的闪退问题，希望快点解决修复😭', '', 0, 11087, '2020-06-16 19:17:01', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (139, 41, 1, '', NULL, NULL, '#希望闲鱼能够看一下我的建议\n建议闲鱼能在卖家发货点“面交”“自提”这类的时候能够增加一个必须经过买家同意的程序。因为确实有很多骗子点“面交”“自提”这类来拖自动确认收货。或者买家的交易钱被因此冻结好几天，万一人家急用，却被恶心的卖家骗子而耽误。其他地方闲鱼还是做得很好的！如果之后再有机会的话，希望可以增加卖定金，补尾款的程序，那样子就更完善了。不过这个没有也没关系，前面那个“面交”“自提”才是最希望你们能够改善的。感谢！', '#希望闲鱼能够看一下我的建议\n建议闲鱼能在卖家发货点“面交”“自提”这类的时候能够增加一个必须经过买家同意的程序。因为确实有很多骗子点“面交”“自提”这类来拖自动确认收货。或者买家的交易钱被因此冻结好几天，万一人家急用，却被恶心的卖家骗子而耽误。其他地方闲鱼还是做得很好的！如果之后再有机会的话，希望', '', 0, 11081, '2020-06-17 10:41:57', '2020-08-20 12:09:54', NULL, NULL);
