INSERT INTO `fb_posts` VALUES (165, 19, 1, '', NULL, NULL, '经朋友推荐下载了这个多抓鱼，我俩同为搬家和没钱的痛苦所折磨，收书的功能非常方便好用。使用一段时间后，发现app上还经常能找到市面上绝迹的书，越来越喜欢。想提建议是，家中购有不少艺术 设计类书籍，如画册、设计理论、设计合集期刊、绘本等，有近一半是被拒收的，不知以后能否能进一步优化和扩大收书范围呢？', '经朋友推荐下载了这个多抓鱼，我俩同为搬家和没钱的痛苦所折磨，收书的功能非常方便好用。使用一段时间后，发现app上还经常能找到市面上绝迹的书，越来越喜欢。想提建议是，家中购有不少艺术 设计类书籍，如画册、设计理论、设计合集期刊、绘本等，有近一半是被拒收的，不知以后能否能进一步优化和扩大收书范围呢？', '', 0, 6, '2020-06-21 16:27:32', '2020-06-21 17:02:41', '2020-06-21 17:02:41', NULL);
