INSERT INTO `fb_posts` VALUES (167, 69, 1, '', NULL, NULL, '亲爱的流利说大人： 求增加单词电台的功能，希望能听取收藏的单词，只複读单词和中文意思就好， 建议来一个磨耳朵的单词复读功能，科学的有效果的复读单词，而达至不用死记，多听就能记住单词。 希望能出一套这样的复读单词模式，如 APPLE APPLE -３秒- APPLE（0.6x慢速） - ３秒- APPLE（0.6x慢速） - ３秒- APPLE - ３秒-苹果（中文词义） - ３秒- APPLE -３秒- APPLE- 之后 间隔8秒 到下一个词 （给大脑 回味一下这个词 ）。 这种方式 可以 更好的 有助于 单词的 记忆。还可以结合学习的数据，如难记的单词 再重复一次或二次，这个流程，才到下一个词。 另外读的中文词义 也希望能自定义，因为不少单词需要抽象记忆 。最后， 希望贵APP越做越强大哈。', '亲爱的流利说大人： 求增加单词电台的功能，希望能听取收藏的单词，只複读单词和中文意思就好， 建议来一个磨耳朵的单词复读功能，科学的有效果的复读单词，而达至不用死记，多听就能记住单词。 希望能出一套这样的复读单词模式，如 APPLE APPLE -３秒- APPLE（0.6x慢速） - ３秒- APP', '', 0, 10955, '2020-06-22 15:04:10', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (168, 70, 1, '', NULL, NULL, 'Walkr四年前一出就开始玩了，四年后再回来，整个游戏优化的地方非常多，但当初让人觉得不便的问题也依旧在的，总体来说walkr依旧是当初的walkr，不忘初衷这很难得，walkr依旧是当初的walkr，是因为有问题walkr还是很难找到人处理，甚至比最初更难！提几个建议，希望能被看到！首先是小番茄收取，现在成熟都是食物和球混合一起，特别是前期的星球需要补充的食物并不多，遇到DFR就得一直翻，找球收后再去收食物，以免浪费，而恰恰前期也是DFR建的最密集的部分！希望可以更细致化些，球归球，食物归食物，两个按键！另一个是能量提升速度问题，现在提升速度如果选择能量就是直接清空，这就导致立刻没有存货，这点真的非常无奈，而随着星球的增加需要的时间越多，能量越多，为什么不能在选择用能量提升星球时可以自己输入使用多少能量，这样可以更有利于自己规划资源！', 'Walkr四年前一出就开始玩了，四年后再回来，整个游戏优化的地方非常多，但当初让人觉得不便的问题也依旧在的，总体来说walkr依旧是当初的walkr，不忘初衷这很难得，walkr依旧是当初的walkr，是因为有问题walkr还是很难找到人处理，甚至比最初更难！提几个建议，希望能被看到！首先是小番茄收', '', 0, 10953, '2020-06-22 15:05:53', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (169, 71, 1, '', NULL, NULL, 'iCity很实用，日常记录生活点滴，用了一段时间有些意见，仅供参考。1.文字不方便剪切，发送后局部文字不能选择剪切拷贝2.自己图片上传后不支持再次下载3.编辑权限时间太短了，希望可以支持随时编辑，希望越办越好(*^．^*)', 'iCity很实用，日常记录生活点滴，用了一段时间有些意见，仅供参考。1.文字不方便剪切，发送后局部文字不能选择剪切拷贝2.自己图片上传后不支持再次下载3.编辑权限时间太短了，希望可以支持随时编辑，希望越办越好(*^．^*)', '', 0, 10953, '2020-06-22 15:18:36', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (170, 72, 1, '', NULL, NULL, '玩奇迹暖暖也有四五年了，真的非常喜欢这个游戏，也满足了我想要搭配的小愿望。但是！！！真的超级希望奇迹暖暖iOS系统能和安卓系统互通啊！以前用安卓系统已经玩到了一种高度吧😂现在换了苹果又要重新开始，真的好可惜，放不下她，可是也不想从零开始了。要是真能互通就好了啊啊啊啊啊啊啊啊啊（心心念念）', '玩奇迹暖暖也有四五年了，真的非常喜欢这个游戏，也满足了我想要搭配的小愿望。但是！！！真的超级希望奇迹暖暖iOS系统能和安卓系统互通啊！以前用安卓系统已经玩到了一种高度吧😂现在换了苹果又要重新开始，真的好可惜，放不下她，可是也不想从零开始了。要是真能互通就好了啊啊啊啊啊啊啊啊啊（心心念念）', '', 0, 10953, '2020-06-22 15:20:10', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (171, 73, 1, '', NULL, NULL, 'MindNode我认为是最好看的思维导图app。 以下几点可以改善就更好啦： 1. 支持直接插入绘图。有pencil就有用起来！ 设计专业非常需要直接画图！（切换软件画再倒入太麻烦了会打断思绪！） 2. 希望支持更多中文字体！ 3. 希望支持一次性购买！ 评论更新：感谢及时的回复！非常感谢对“插入绘画”的指引！！', 'MindNode我认为是最好看的思维导图app。 以下几点可以改善就更好啦： 1. 支持直接插入绘图。有pencil就有用起来！ 设计专业非常需要直接画图！（切换软件画再倒入太麻烦了会打断思绪！） 2. 希望支持更多中文字体！ 3. 希望支持一次性购买！ 评论更新：感谢及时的回复！非常感谢对“插入绘', '', 0, 10952, '2020-06-22 15:22:32', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (172, 74, 1, '', NULL, NULL, '百词斩是我用过背单词软件里使用感受最好的，但也希望能不断改进。 1，增加制作适应iPad版本。2，建议核查单词学习书。不知道怎么回事，对应的课本中的单词表，在百词斩中的并没有看到。建议开发者更新单词学习书。3，建议增加自定义单词背诵。我觉得不难实现，请开发者斟酌。4，语音填空还需要进一步完善。5，单词小考建议增加不同的考试方式。第一次这么认真写反馈，希望开发者能看到，尽快推出。', '百词斩是我用过背单词软件里使用感受最好的，但也希望能不断改进。 1，增加制作适应iPad版本。2，建议核查单词学习书。不知道怎么回事，对应的课本中的单词表，在百词斩中的并没有看到。建议开发者更新单词学习书。3，建议增加自定义单词背诵。我觉得不难实现，请开发者斟酌。4，语音填空还需要进一步完善。5，单', '', 0, 10952, '2020-06-22 15:25:20', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (173, 75, 1, '', NULL, NULL, '#得到听书\n针对听书栏目的的功能应该改进： 1、目前只是对书单进行了分类，但分类后的书单没有排序功能，也不能一键将一个类别或想听的书加入书架，非得一本一本的添加。 2、书架里面没有分类、排序功能。 3、学习计划可以增加听书内容，但不能自定义选书，随着解读的图书增多，推荐的很多书不是想听的书，想听的书又加不进来。 强烈建议改进！', '#得到听书\n针对听书栏目的的功能应该改进： 1、目前只是对书单进行了分类，但分类后的书单没有排序功能，也不能一键将一个类别或想听的书加入书架，非得一本一本的添加。 2、书架里面没有分类、排序功能。 3、学习计划可以增加听书内容，但不能自定义选书，随着解读的图书增多，推荐的很多书不是想听的书，想听的书', '', 0, 10951, '2020-06-22 15:31:56', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (174, 76, 1, '', NULL, NULL, '#网易蜗牛读书iPad不适配\n特别喜欢出版书籍，书库比较全，原来只在手机上看，非常喜欢蜗牛app，冲了会员，但现在iPad提供了分屏及多任务功能，app适配情况比较差，开分屏的时候无法显示全部文字，多任务状态时连文字都看不见了，希望尽快适配！', '#网易蜗牛读书iPad不适配\n特别喜欢出版书籍，书库比较全，原来只在手机上看，非常喜欢蜗牛app，冲了会员，但现在iPad提供了分屏及多任务功能，app适配情况比较差，开分屏的时候无法显示全部文字，多任务状态时连文字都看不见了，希望尽快适配！', '', 0, 10951, '2020-06-22 15:36:40', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (175, 77, 1, '', NULL, NULL, '#建议好好住增加收藏夹内的查找功能\n非常好的一款家居app，但又不仅是装修等话题，有无数美好的生活方式可以欣赏、借鉴。 作为老用户提个建议，现在好内容越来越多了，收藏夹存了不少文章、问答等，要找的时候竟然没法做关键词搜索，要顺着收藏的200多条一条条捋… 这个有点不友好啊，建议下一版增加功能。 谢谢带给我一个美好的社区。', '#建议好好住增加收藏夹内的查找功能\n非常好的一款家居app，但又不仅是装修等话题，有无数美好的生活方式可以欣赏、借鉴。 作为老用户提个建议，现在好内容越来越多了，收藏夹存了不少文章、问答等，要找的时候竟然没法做关键词搜索，要顺着收藏的200多条一条条捋… 这个有点不友好啊，建议下一版增加功能。 谢谢', '', 0, 10951, '2020-06-22 15:42:19', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (176, 78, 1, '', NULL, NULL, '请问foodie拍完照后保存到专属的foodie相册这个功能没了吗？找某张食物照片的时候发现foodie相册已经没有最近的照片了 停留在去年7月，是取消了这个功能吗？这样找图好不方便啊！希望把功能改回来，或者设置中增加选项，自行选择要不要创建专属相册嘛😭', '请问foodie拍完照后保存到专属的foodie相册这个功能没了吗？找某张食物照片的时候发现foodie相册已经没有最近的照片了 停留在去年7月，是取消了这个功能吗？这样找图好不方便啊！希望把功能改回来，或者设置中增加选项，自行选择要不要创建专属相册嘛😭', '', 0, 10951, '2020-06-22 15:44:55', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (177, 79, 1, '', NULL, NULL, '咔嗒是真的很好用了，调色什么的都很完美，我很喜欢，只不我希望注册账号可以完善一下地区，对香港的电话有点不友好，所以现在不能登录，希望可以改善一下叭，最后我很想说这个APP真的超棒鸭！！', '咔嗒是真的很好用了，调色什么的都很完美，我很喜欢，只不我希望注册账号可以完善一下地区，对香港的电话有点不友好，所以现在不能登录，希望可以改善一下叭，最后我很想说这个APP真的超棒鸭！！', '', 0, 10951, '2020-06-22 15:48:55', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (178, 80, 1, '', NULL, NULL, '衣二三用了2年半，开始的时候不错，大大释放衣柜的收纳压力，无压力的尝试换着一些不同风格，当时衣服的品质也好，看的出来当时是有用心做的。 不过，最近一年的客服真的很差，推卸责任，一件事翻来覆去的要去联系解决，之前一件衣服的问题，拖了一整个月，投诉两次才结束。 另外一个是，规则常常变，规则的变化不会发通知给客户，当造成麻烦，去问客服，才甩出来：对，规则变了，请谅解。当表示不谅解，再甩一个回来：那别用就好了。要求退款退剩余的会员时间，再甩一个：哦，不够30天，退不了哦，请谅解。 还有一个侵犯消费者权益的具体例子：本人坐标广州，以前广州有一个仓，即使不用加钱升顺丰，基本第二天就会收到。现在广州仓撤了，换成南通的，下一次单需要等至少3天整才会收到，寄回也要同样的时间，想想包月是💰499，平均每天💰16，不连续租，得花💰96➕在路上。emmm……投诉？！只会说抱歉，怎么解决邮寄时间变长？只能补一天的给你，对，一天！而且是这次投诉才补的！后面再下单增加的邮寄时间？请谅解！！！ 最近一年衣服的品质参差不齐，也有衣服是很旧的（就是明显穿洗过非常多次，已经掉色，起毛，白色部分也变色的那种）4件里面有三件能穿都是幸运了，还试过整个衣箱只有一件勉强能穿出门的。 个人经历，给大家参考参考吧，想尝试不同风格的，可以连续不间断的租，这是利益最大化的，但只是偶尔想换换风格的话，💰499一个月，踏踏实实的买衣服不香嘛？', '衣二三用了2年半，开始的时候不错，大大释放衣柜的收纳压力，无压力的尝试换着一些不同风格，当时衣服的品质也好，看的出来当时是有用心做的。 不过，最近一年的客服真的很差，推卸责任，一件事翻来覆去的要去联系解决，之前一件衣服的问题，拖了一整个月，投诉两次才结束。 另外一个是，规则常常变，规则的变化不会发通', '', 0, 10948, '2020-06-22 17:39:05', '2020-08-20 12:09:54', NULL, NULL);
