INSERT INTO `fb_posts` VALUES (180, 82, 1, '', NULL, NULL, '希望开发大大看到并回复和改进B612！！这个软件好有是好用，让我爱的一个点是它的照片模式居然放大，因为连美图秀秀都没有这个功能。（美图秀秀也算可以，但是它占内存空间大，我手机才16G。你这个软件是我感觉除了美图秀秀之外最好用的软件了） 我想建议一下，就是超级超级想让你们加一个（P图那边的）文字功能，因为没有文字功能会有些不方便（超级超级建议）。另外一个就是你们最好开发一个（也是P图那边的）修容笔，修容笔要不要加还可以不用，但是如果作者大大看到了，请一定一定要加上一个文字功能（如果不加的话，我就可能要转粉了到别的地方了，为什么 因为没有文字功能我真的会很不方便，但是美图秀秀我有下载不了），以上是我的建议，希望开发大大能看到，并回复或者改进！！', '希望开发大大看到并回复和改进B612！！这个软件好有是好用，让我爱的一个点是它的照片模式居然放大，因为连美图秀秀都没有这个功能。（美图秀秀也算可以，但是它占内存空间大，我手机才16G。你这个软件是我感觉除了美图秀秀之外最好用的软件了） 我想建议一下，就是超级超级想让你们加一个（P图那边的）文字功能，', '', 0, 10948, '2020-06-22 17:46:05', '2020-08-20 12:09:54', NULL, NULL);
