INSERT INTO `fb_posts` VALUES (183, 85, 1, '', NULL, NULL, '很希望时间规划局能改进一下动态壁纸的背景音乐。目前背景音乐无法选取，啊，这个真的烦。虽然背景语音也不错，但是也太短了吧。几秒！！长一点的十几秒。希望可以自己配背景音乐。啊！快看到我吧。快改进吧！简言之，希望可以改成自己挑背景壁纸，自己挑背景音乐。混搭嘛！！！！！！', '很希望时间规划局能改进一下动态壁纸的背景音乐。目前背景音乐无法选取，啊，这个真的烦。虽然背景语音也不错，但是也太短了吧。几秒！！长一点的十几秒。希望可以自己配背景音乐。啊！快看到我吧。快改进吧！简言之，希望可以改成自己挑背景壁纸，自己挑背景音乐。混搭嘛！！！！！！', '', 0, 10879, '2020-06-22 20:36:30', '2020-08-20 12:09:54', NULL, NULL);
