INSERT INTO `fb_posts` VALUES (201, 101, 1, '', NULL, NULL, '首先我觉得概念画板真的是很棒的。最初看上这款软件也是应为里面的调色盘，和开发商的认真负责的态度，不过还是有几点小建议想要提出来1、软件使用过程中的美中不足就是对于“填充”的使用，我不知道是我没研究透还是什么，希望到时候能够出现那种在一个封闭图形中点一下就能上色的倒色桶 2、增加调色盘。调色盘可以适当补充一些颜色 3、对于水彩笔的使用。建议添加提个类似水彩笔的画笔，原配的水彩笔晕染的太厉害，即使粗细调小了。 4、橡皮的不足。只款软件第二个可以改进的地方就是橡皮。如果我用硬角遮盖的话希望能够擦的圆滑一点，比如，我画两条几乎重叠的线条，用硬角遮盖一擦，基本上做不到擦的很干净、圆润，也就是说一般如果想擦半根线条是不可能的（可以自己试一下）你若想擦半根线一般一整根线都会被擦掉（这一部分可能表达不清楚） 5、不同的橡皮。在橡皮这方面我认为还可以添加一个“完整橡皮”就是例如画了一个圆，你只要用这个这个圆弧上的在任意地方点一下就可以将整个圆擦掉，这个功能在很多别的画图软件里都有，总而言之就是一次擦一笔。 以上是我个人使用这个软件时发现的一些可以改进的地方，我不清楚若需改进这些方面的难度有多大毕竟我不是专业人士。总的来说，还是很棒的！', '首先我觉得概念画板真的是很棒的。最初看上这款软件也是应为里面的调色盘，和开发商的认真负责的态度，不过还是有几点小建议想要提出来1、软件使用过程中的美中不足就是对于“填充”的使用，我不知道是我没研究透还是什么，希望到时候能够出现那种在一个封闭图形中点一下就能上色的倒色桶 2、增加调色盘。调色盘可以适当', '', 0, 10593, '2020-06-23 10:26:02', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (202, 102, 1, '', NULL, NULL, '#给梦间集天鹅座的建议\n开始玩的时候，咖啡厅是个很吸引人的部分，有了一种经营类游戏的感觉，让人欲罢不能；剧情的话说来惭愧，我是快进过得，就是为了达成成就，不好评价；每期活动什么的奖励还是很客观的，达成难度也不高；最重要的集卡，不知道是我运气好还是真的掉率挺高，没氪金也能拥有不少ssr，特别是活动的，单抽居然也能出，开心(∩ᵒ̴̶̷̤⌔ᵒ̴̶̷̤∩) 下面来说说瑕疵部分，首先的话，声优方面确实有待加强，声音有些浮于表面，让人带入不了；其次就是遇到天花板了，目前所有人的剧情都过了，咖啡厅也满级，如果不是有活动，每天的话只能单调的做做餐点，偶尔抽卡，继续下去的激情不是很高 其他就是一些优化，例如猫爪小铺购买增加数量选择；外卖增加一键外卖，实现满足条件的订单全部清算；一些过场动画实现单击或者可跳过选择，增加舒适感。', '#给梦间集天鹅座的建议\n开始玩的时候，咖啡厅是个很吸引人的部分，有了一种经营类游戏的感觉，让人欲罢不能；剧情的话说来惭愧，我是快进过得，就是为了达成成就，不好评价；每期活动什么的奖励还是很客观的，达成难度也不高；最重要的集卡，不知道是我运气好还是真的掉率挺高，没氪金也能拥有不少ssr，特别是活动的，', '', 0, 10563, '2020-06-23 10:34:25', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (203, 103, 1, '', NULL, NULL, '希望岛读可以增加收藏好句的功能！ 长按这句话的时候会出现收藏，然后在我的里面添加这个收藏的入口，点进去后可以看到自己收藏过的句子列表。甚至还可以导出pdf之类的文档，就更棒了！不知道会不会涉及版权问题？我很乐意为这个功能付费。希望开发者继续努力，越做越好！', '希望岛读可以增加收藏好句的功能！ 长按这句话的时候会出现收藏，然后在我的里面添加这个收藏的入口，点进去后可以看到自己收藏过的句子列表。甚至还可以导出pdf之类的文档，就更棒了！不知道会不会涉及版权问题？我很乐意为这个功能付费。希望开发者继续努力，越做越好！', '', 0, 10562, '2020-06-23 10:36:17', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (204, 29, 1, '', NULL, NULL, '苏宁易购app能不能争口气啊？干不掉🐱，打不过🐶，你🦁的威风呢？每次打开首页，图片都要加载一会儿才全部显示出来，不能优化一下app么？还有苏宁自营的物品怎么越来越少了，收购了家乐福就不管线上销售了吗？让我觉得我这个会员开的很不值！', '苏宁易购app能不能争口气啊？干不掉🐱，打不过🐶，你🦁的威风呢？每次打开首页，图片都要加载一会儿才全部显示出来，不能优化一下app么？还有苏宁自营的物品怎么越来越少了，收购了家乐福就不管线上销售了吗？让我觉得我这个会员开的很不值！', '', 0, 2, '2020-06-23 10:38:12', '2020-06-23 10:39:57', '2020-06-23 10:39:57', NULL);
INSERT INTO `fb_posts` VALUES (205, 29, 1, '', NULL, NULL, '苏宁易购app能不能争口气啊？干不掉🐱，打不过🐶，你🦁的威风呢？每次打开首页，图片都要加载一会儿才全部显示出来，不能优化一下app么？还有苏宁自营的物品怎么越来越少了，收购了家乐福就不管线上销售了吗？让我觉得我这个会员开的很不值！', '苏宁易购app能不能争口气啊？干不掉🐱，打不过🐶，你🦁的威风呢？每次打开首页，图片都要加载一会儿才全部显示出来，不能优化一下app么？还有苏宁自营的物品怎么越来越少了，收购了家乐福就不管线上销售了吗？让我觉得我这个会员开的很不值！', '', 0, 10562, '2020-06-23 10:38:17', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (206, 105, 1, '', NULL, NULL, '每日故宫让我一个00后都喜欢上古董了，尤其笔记也很好看，但是还是有以下几点瑕疵： 1.当初下这个软件就是奔着文物介绍来的，想涨点姿势，结果很可惜，居然没有，偶尔有的那么几个还是特定活动时几少部分才有。扣分。 2.画面占比太大，不能看清楚文物。布局占屏太满，感觉好像把脸贴在文物上一样，眼镜感官很不舒服，尤其放大后画质也模糊了。 你可以放大，别让客户来缩小啊！扣分！ 综合上述两点，建议做出改进： 1.每个文物都配介绍，百度上也有，虽然费功夫， 但体验更好，下载人也多。 2.介于此，建议设计搜索模板，不用上百度，比如我想查四羊方尊，你这里可以直接搜索到。这个功能出来的话，这个APP付费我也想要了。当然要不要跟进扫描识别文物的技术是你们的事情。 3.文物在日历时可以放大，很有美感，但日历点开后就把文物图像缩回去、放在正中间好了，背景或宣纸或茶渍，如果需要进一步查看，点一下，这才放大，随之对这个文物介绍的选项就跟进。 打了半小时字，希望能被开发者采纳！', '每日故宫让我一个00后都喜欢上古董了，尤其笔记也很好看，但是还是有以下几点瑕疵： 1.当初下这个软件就是奔着文物介绍来的，想涨点姿势，结果很可惜，居然没有，偶尔有的那么几个还是特定活动时几少部分才有。扣分。 2.画面占比太大，不能看清楚文物。布局占屏太满，感觉好像把脸贴在文物上一样，眼镜感官很不舒服', '', 0, 10560, '2020-06-23 10:45:45', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (207, 104, 1, '', NULL, NULL, '美团外卖一个月会员15块钱，6张券，这谁够用？？券不够了还得买加量包，加量包又一点儿都不划算。我寻思着吃个饭还得带个小🧮呗？就不能真正搞点儿让用户得到真正实惠的操作？', '美团外卖一个月会员15块钱，6张券，这谁够用？？券不够了还得买加量包，加量包又一点儿都不划算。我寻思着吃个饭还得带个小🧮呗？就不能真正搞点儿让用户得到真正实惠的操作？', '', 0, 10549, '2020-06-23 10:51:06', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (208, 106, 1, '', NULL, NULL, '#VUE Vlog需要改进的地方\n1.人机界面设计的不是很好，新用户可能一下子摸不着头脑，例如导入素材，要进入拍摄后才能看到，还有保存草稿的界面，如果不摸索根本不知道有这功能，不能一次编辑完成，下次要重新做一遍，我是重复做了不知道多少次，别人告诉我有草稿的功能 .2.能否能加入多轨或多画面的功能，3.能否有简单的抠像功能 4.做一个简单的教学片实例，从导入素材，分段，调整，测试，保存，完成，再调整完善，成片', '#VUE Vlog需要改进的地方\n1.人机界面设计的不是很好，新用户可能一下子摸不着头脑，例如导入素材，要进入拍摄后才能看到，还有保存草稿的界面，如果不摸索根本不知道有这功能，不能一次编辑完成，下次要重新做一遍，我是重复做了不知道多少次，别人告诉我有草稿的功能 .2.能否能加入多轨或多画面的功能，3', '', 0, 10546, '2020-06-23 10:53:31', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (209, 107, 1, '', NULL, NULL, '用过很多背单词应用，最终选择了百词斩，百词斩真的好用，比其他应用干净的多，细节也做的很好~ 但是我想提一个建议：就是你们家的那个“开屏单词海报是真的好看”（点赞）就是能不能加一个：就是把今天单词任务完成后，把“开屏单词海报”作为奖励，而可以用户下载开屏单词海报，但是下载的单词海报如果能去掉海报上的“箭头”就很棒了，我是感觉保留海报中的单词是挺好的，单词结合起图片很美，百词斩的水印本就比较小，保留也很不错，不过要是能取消那个“百词斩”水印也是很棒的（超级棒），望采纳，祝百词斩越来越好~', '用过很多背单词应用，最终选择了百词斩，百词斩真的好用，比其他应用干净的多，细节也做的很好~ 但是我想提一个建议：就是你们家的那个“开屏单词海报是真的好看”（点赞）就是能不能加一个：就是把今天单词任务完成后，把“开屏单词海报”作为奖励，而可以用户下载开屏单词海报，但是下载的单词海报如果能去掉海报上的“', '', 0, 10510, '2020-06-23 11:01:49', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (210, 108, 1, '', NULL, NULL, '#FlipaClip产品建议\n1、希望添加油漆桶参考，当线稿和上色不在一个图层时，能按照 线稿来填色（现在不行，有点难受） 2、铅笔的颜色太淡了，使劲画也画不深。 3、希望能选择在播放时跳过某些帧，这样能比较前后效果，挑选出更好的帧数。', '#FlipaClip产品建议\n1、希望添加油漆桶参考，当线稿和上色不在一个图层时，能按照 线稿来填色（现在不行，有点难受） 2、铅笔的颜色太淡了，使劲画也画不深。 3、希望能选择在播放时跳过某些帧，这样能比较前后效果，挑选出更好的帧数。', '', 0, 11, '2020-06-23 11:07:56', '2020-06-23 11:12:24', '2020-06-23 11:12:24', NULL);
