INSERT INTO `fb_posts` VALUES (213, 110, 1, '', NULL, NULL, '#马卡龙app产品MM在哪\n首先，要说的是，这个软件出来之前，抠图换背景是一件很麻烦的事。现在再也不发愁换背景了。 缺点：1 界面太混乱，比如换背景这个功能，所有的素材堆在一起，而且没有快捷搜索功能，要找一个特定的素材要翻很久，还有可能错过。 2 证件照标准尺寸可选择的范围太少，而且背景固定，不能换成其他背景，如果再想换背景就立刻失去了按尺寸剪裁好的照片。比如2寸照片就只能使用红色，如果想换成其他背景色的两寸标准照是不可能实现的。希望能够改进。', '#马卡龙app产品MM在哪\n首先，要说的是，这个软件出来之前，抠图换背景是一件很麻烦的事。现在再也不发愁换背景了。 缺点：1 界面太混乱，比如换背景这个功能，所有的素材堆在一起，而且没有快捷搜索功能，要找一个特定的素材要翻很久，还有可能错过。 2 证件照标准尺寸可选择的范围太少，而且背景固定，不能换', '', 0, 10431, '2020-06-23 11:22:14', '2020-08-20 12:09:54', NULL, NULL);
