INSERT INTO `fb_posts` VALUES (224, 119, 1, '', NULL, NULL, '#iOS14#屏幕使用时间小组件显示的数字不变啊\n有跟我一样的吗\n这玩意不应该实时更新的吗\n点开是七小时 退出来显示的还是五小时\n除非小组件删了重新加或者重启手机\n要不然这数字不带变的\n是我的问题还是bug？ ​', '#iOS14#屏幕使用时间小组件显示的数字不变啊\n有跟我一样的吗\n这玩意不应该实时更新的吗\n点开是七小时 退出来显示的还是五小时\n除非小组件删了重新加或者重启手机\n要不然这数字不带变的\n是我的问题还是bug？ ​', '', 0, 10318, '2020-06-23 19:32:12', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (225, 118, 1, '', NULL, NULL, '#IOS14# 可能这就是所谓的生命在于折腾吧\n凌晨看到可以更新14 立马更新了 结果并不理想\n很多小组件汉化不完全 使用起来很鸡肋 甚至觉得没有原本的负一屏实用\n确实有bug 例如微信不能选择信息 小组件有时候会乱码\n还有一些细节的改动我不是很喜欢 例如备忘录背景和相机切换模式 没有之前的质感 设置闹钟时间并不是滑动设置 感受不到之前爆吹的线性马达\n再说一说画中画功能 并不是分屏功能 而且不是所有app都可以画中画 特别鸡肋\n个人感觉耗电略快了一些 反应速度还算可以\n所以果断想降回13.5.1 不过中途很多坎坷 一直报错 目前才搞好\n很中肯的建议 想尝鲜的可以用备用机 主力机真不建议 毕竟开发者版本 不是很稳定 而且功能也不是特别的吸引人\n除了背部敲击和浮窗来电以及使用麦克风和相机提示灯 不得不说的是在隐私这方面要进步很多', '#IOS14# 可能这就是所谓的生命在于折腾吧\n凌晨看到可以更新14 立马更新了 结果并不理想\n很多小组件汉化不完全 使用起来很鸡肋 甚至觉得没有原本的负一屏实用\n确实有bug 例如微信不能选择信息 小组件有时候会乱码\n还有一些细节的改动我不是很喜欢 例如备忘录背景和相机切换模式 没有之前的质感 设', '', 0, 10317, '2020-06-23 19:35:31', '2020-08-20 12:09:54', NULL, NULL);
