INSERT INTO `fb_posts` VALUES (229, 121, 1, '', NULL, NULL, '用开言差不多一个月多了，每天没有断打卡，听fm是一种享受，再做做笔记每天都有收获，现在的目标是听完所有的fm。有个小建议希望可以被采纳吧： 把开言fm按年份或者月份区分一下，每次听以前的都要爬楼去听，超过一千期的fm真的楼太高爬不动哈哈', '用开言差不多一个月多了，每天没有断打卡，听fm是一种享受，再做做笔记每天都有收获，现在的目标是听完所有的fm。有个小建议希望可以被采纳吧： 把开言fm按年份或者月份区分一下，每次听以前的都要爬楼去听，超过一千期的fm真的楼太高爬不动哈哈', '', 0, 10197, '2020-06-24 12:15:15', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (230, 122, 1, '', NULL, NULL, '#canva产品经理在哪里\n1、网页版跟手机版是两个不同运营吗？我用谷歌邮箱注册的账号网页版登都登录不进去？ 2、导出bug是只有我有吗？海报导出异常、白线框、规格尺寸错误、给个模版给我让我改字导出来的都和原来的不一样？你们是佳能屏幕设计师吗？ 3、不能横屏或放大设计？旋转图片和拖拽图片功能不灵敏？我一下午像个老年人一样在四分之一个屏幕里找被我误触的图片🙃体验感太差了 如果是真的要我充钱才能正常体验那我还不如买个Adobe全家桶', '#canva产品经理在哪里\n1、网页版跟手机版是两个不同运营吗？我用谷歌邮箱注册的账号网页版登都登录不进去？ 2、导出bug是只有我有吗？海报导出异常、白线框、规格尺寸错误、给个模版给我让我改字导出来的都和原来的不一样？你们是佳能屏幕设计师吗？ 3、不能横屏或放大设计？旋转图片和拖拽图片功能不灵敏？', '', 0, 10197, '2020-06-24 12:21:29', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (231, 123, 1, '', NULL, NULL, '首先说明，我只是个普通的洋葱用户。 一.洋葱数学的授课老师都是名校毕业的高材生，制作视频肯定需要耗费人力和财力，不花钱全免费不得亏死？所以什么会员贵都是理所因当的。 二.网卡，经常掉线卡顿。第一是因为自家网是真的不好，第二就可能是使用的人太多，服务器承受不过来。 三.作业问题。这个我不说什么，因为这真的是一个问题。程序员哥哥辛苦一点来改进一下吧～然后我很奇了，做作业的时候为什么要切换页面？而且做作业途中在现实里干别的事，只要洋葱页面不关不就可以了吗？我就这么做的🙃四.客服态度.有人说客服态度恶劣，我曾经也咨询过客服，难不成我跟你们咨询的客服不是同一个洋葱的？做人需要有一点耐心，如果等的太久，算作是浪费你的时间，可以适当投诉。 五.竞技场PK问题.这个问题我也困扰了很久，但唯一可以确定的是PK到的人不会全都是人机，然后后面的时间，我也搞不懂🌝毕竟我不是工作人员咱不晓得咱也不敢问🌝————分界线———— 我充了数学的物理的VIP，果然充了钱就有用！呃不对应该是可以学的东西更多了🌝数学的讲解十分有趣，物理中的小实验我最为钟爱。在学校不懂的知识点，回到家看一下视频，知识就是唰唰的来啊！说句真心的，里面的视频讲解偏次元风，通俗易懂我很喜欢哈哈哈哈哈哈。然后还请官方赶快修正一下一个号可以多人同时登录的情况（这情况也不是一定会出现，出现概率占50%）谢谢！', '首先说明，我只是个普通的洋葱用户。 一.洋葱数学的授课老师都是名校毕业的高材生，制作视频肯定需要耗费人力和财力，不花钱全免费不得亏死？所以什么会员贵都是理所因当的。 二.网卡，经常掉线卡顿。第一是因为自家网是真的不好，第二就可能是使用的人太多，服务器承受不过来。 三.作业问题。这个我不说什么，因为这', '', 0, 10197, '2020-06-24 12:23:47', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (232, 125, 1, '', NULL, NULL, '#OPPO手环建议#\n1.我希望未来的OPPO的手环可以显示手环使用时长，使用时长这么常用的功能不应该丢弃。\n2我希望未来的OPPO手环可以实现全天候睡眠检测功能\n3我希望未来的OPPO手环可以拥有更强大的连接和控制能力。可以给手环加上设备控制功能和手机寻找功能，在手环连接范围内点击手机寻找，手机就会自动震动响铃；当手环与手机断开连接时手环会发出震动提示；对于设备控制，可以植入breeno实现一定范围内的控制能力。\n4.我希望未来的OPPO手环可以更加人性化，交互更加自然，可玩性更高。可以内置breeno助手增加可玩性；可以设计更多动态表盘提升美感；对于图标可以实现一定程度的动态化', '#OPPO手环建议#\n1.我希望未来的OPPO的手环可以显示手环使用时长，使用时长这么常用的功能不应该丢弃。\n2我希望未来的OPPO手环可以实现全天候睡眠检测功能\n3我希望未来的OPPO手环可以拥有更强大的连接和控制能力。可以给手环加上设备控制功能和手机寻找功能，在手环连接范围内点击手机寻找，手机就', '', 0, 10179, '2020-06-25 13:30:08', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (234, 30, 1, '', NULL, NULL, '#率土之滨宝物系统# 个人认为，目前的宝物系统主要影响了队伍强度对抗、土豪平民对抗、新区老区对抗这三方面的平衡关系，同时使账号价值大幅缩水，鉴于率土的底层机制无法回档，于是新方案只能对宝物系统做出修改。\n可是，满足任一方面的平衡，都会对其他方面的平衡造成破坏。冥思苦想之下，个人设计出如下修改方案：\n1.宝物系统自S3起开放获取渠道；\n2.宝物系统在S3作为限制系统，禁止使用，以此消除未来老区回流玩家对新区玩家的过度冲击，并使新区玩家在S3得以对宝物系统获得初步了解与储备；\n3.降低宝物系统材料的获取难度、降低宝物属性强度，具体属性类别、数值可协商确定；\n4.征服赛季各剧本分设两个版本：可使用宝物版、不可使用宝物版，备战区玩家可自主选择任一版本的任一剧本下设区服体验游戏。\n这样，可使用宝物版的剧本版本作为高端局存在，不可使用宝物版的剧本版本作为普通局存在，当平民玩家积攒了足够宝物之后，也可选择去高端局体验不一样的环境，而土豪玩家则可更早通过高端局对抗证明自身、本同盟的实力。另一方面，藏宝阁无宝物的高红号在普通局一样可以获得不错的游戏体验，其账号价格短期内应当不至于大幅跳水。', '#率土之滨宝物系统# 个人认为，目前的宝物系统主要影响了队伍强度对抗、土豪平民对抗、新区老区对抗这三方面的平衡关系，同时使账号价值大幅缩水，鉴于率土的底层机制无法回档，于是新方案只能对宝物系统做出修改。\n可是，满足任一方面的平衡，都会对其他方面的平衡造成破坏。冥思苦想之下，个人设计出如下修改方案：\n', '', 0, 2, '2020-06-25 21:13:47', '2020-06-25 21:18:24', '2020-06-25 21:18:24', NULL);
INSERT INTO `fb_posts` VALUES (235, 104, 1, '', NULL, NULL, '#率土建议录# 如果是站在可玩性的角度思考问题，我有如下几点改造建议，欢迎各位大神补充。\n1.宝物系统天赋化，意思是，每个赛季初始化都会有相同的一批次宝物，和天赋点，玩家可以自行给刀上天赋，每个人天赋点有限，选择有限，打造出来的宝物各有特色。\n2.宝物专属化，例如关羽专属青龙偃月刀，这种区别于天赋化，可以自身持有，在特性上和关羽属性契合度高又不完全打破平衡，给玩家更多思考，这种宝物类似于卡包永久持有。\n3.氪金程度化，游戏系统的推出多半是为了盈利，这无可厚非，取之有道方为长久之计，拉大各程度玩家之间的差距都会将游戏模式送上死路，在不影响任何属性的情况下，可以进行，一，皮肤化，例如武器炫光，攻击特效，声音特效（卡包上已经做出尝试）。二，购买专属武器（可以适度加强自身技能，例如荀彧的驱虎吞狼可禁疗两回合，玩家并不觉得有什么不妥），这也是弥补现在武将出场率的机会，以后遇到需要加强的武将，出武器就行。', '#率土建议录# 如果是站在可玩性的角度思考问题，我有如下几点改造建议，欢迎各位大神补充。\n1.宝物系统天赋化，意思是，每个赛季初始化都会有相同的一批次宝物，和天赋点，玩家可以自行给刀上天赋，每个人天赋点有限，选择有限，打造出来的宝物各有特色。\n2.宝物专属化，例如关羽专属青龙偃月刀，这种区别于天赋化', '', 0, 10147, '2020-06-25 21:17:18', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (236, 21, 1, '', NULL, NULL, '2020年6月24日入坑恶果之地，玩了大概8小时。全程总结一句话，难！真TM的难。玩过元气骑士，现在体会元气是真心简单了（相比较）。恶果之地，武器首先就限制非常大，无论是火力还是弹药都特别弱，我感觉瞄准不太好用，所以不知道为什么尝尝打不准。近战武器没敢用，怕自己手残暴毙。小怪通常都有两个技能，虽然数量少但是特别强。后期有迷雾、无规律子弹和自爆以后，难度直线上升。开始打Boss我不太清楚它们的攻击方式，一直暴毙，速度快弹幕多是我没想到的，而且Boss往往都可以召唤小怪，让我有点崩溃，可能是我太菜的缘故吧。不知道什么原因，手机有一些掉帧，骁龙845处理器按说运行一个300MB的游戏应该差不多呀？哈哈哈哈，看来手机需要退休了。特别喜欢这款画风的游戏。\n以下我再指出几点不足之处，希望可以改进。首先是敌方单位我总是看不清，画风打击感很好，就是小怪本身和弹幕，我注意不到，可能是颜色过于相同，加上我色弱的原因吧。希望可以增加一个淡红色的攻击圈，表示这个敌人在此处需要注意。还有一个技能，冷却时间国产，打完一个小关卡之后，有二分之一的时间在等技能CD，希望可以脱战之后技能冷却加快或者直接增强技能冷却速度。还有武器，有时候我总是瞎按导致冷却过短，希望有个可以冷却100%才能开枪的设置。游戏的内容还可以，但是玩了几个小时，基本上所有Boss都见面了，希望可以增添其他地图，列如，火山或者沼泽像元气一样让游戏的内容随机化，我认为这能极大的提升游戏的体验。', '2020年6月24日入坑恶果之地，玩了大概8小时。全程总结一句话，难！真TM的难。玩过元气骑士，现在体会元气是真心简单了（相比较）。恶果之地，武器首先就限制非常大，无论是火力还是弹药都特别弱，我感觉瞄准不太好用，所以不知道为什么尝尝打不准。近战武器没敢用，怕自己手残暴毙。小怪通常都有两个技能，虽然数', '', 0, 10140, '2020-06-25 21:40:40', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (237, 26, 1, '', NULL, NULL, '#小小军团建议#\n我经常遇到的问题场景如下：\n1，经常想拖拽的时候，却变成点击事件\n2，触控面积不精准，经常点a变成b。要拼命旋转放大才能精准控制\n3，如果放大的话，拖动后排骑士到对面后排就只能跨屏幕，拖动屏幕很容易画歪\n4，画的线不能隐藏，比较复杂的线影响视觉。有时候逼得我只能重置，再划一次\n\n建议如下：\n区分划线和调阵容2钟操作交互，如固定最佳分辨率，分全局视角和精准视角2个。\n全局视角：可以简单做到低精准度的操作，如上下阵换位\n精准视角：放大内容区域，可以做高精度的操作，如划线\n优化镜头锁定：划线过程中接近屏幕边缘前就要自动偏移，现在太不灵敏【或者支持多点触屏？按住中，其他手指可以滑动背景】。\n新增阵容模板：一般常用的要么左侧要么右侧，有个阵容模板可以快速切换。\n线路隐藏：可隐藏/显示已描绘的敌我线路\n', '#小小军团建议#\n我经常遇到的问题场景如下：\n1，经常想拖拽的时候，却变成点击事件\n2，触控面积不精准，经常点a变成b。要拼命旋转放大才能精准控制\n3，如果放大的话，拖动后排骑士到对面后排就只能跨屏幕，拖动屏幕很容易画歪\n4，画的线不能隐藏，比较复杂的线影响视觉。有时候逼得我只能重置，再划一次\n\n建', '', 0, 10135, '2020-06-25 21:54:39', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (238, 24, 1, '', NULL, NULL, '我特别推荐钉钉，不仅让我们每天都可以看到早晨的月亮，还可以在晚上享受曰光浴，各种世界罕见的奇观都展现在我们面前！特别是老师发提交作业时的那个＂钉＂的一声，真的是让我留恋忘返！自从用了钉钉，视力提高了，天天做在椅子上长瘦了，妈妈再也不用担心我的体重了……最后我只想说：＂钉钉，我爱你！你半夜钉起来真好听，特别像午夜凶铃和闪灵！你白天钉起来真好听，特别像大妈在广场上放凤凰传奇！总而言之，你让作业爱上了我！谢谢你！', '我特别推荐钉钉，不仅让我们每天都可以看到早晨的月亮，还可以在晚上享受曰光浴，各种世界罕见的奇观都展现在我们面前！特别是老师发提交作业时的那个＂钉＂的一声，真的是让我留恋忘返！自从用了钉钉，视力提高了，天天做在椅子上长瘦了，妈妈再也不用担心我的体重了……最后我只想说：＂钉钉，我爱你！你半夜钉起来真好听', '', 0, 10093, '2020-06-26 19:13:14', '2020-08-20 12:09:54', NULL, NULL);
