INSERT INTO `fb_posts` VALUES (240, 45, 1, '', NULL, NULL, '用酷狗也三年了，也见证了酷狗许多大大小小的变化。但是，我想提几点建议，希望采纳。 1，可不可以把每一首歌曲添加的时间或者收藏到歌单的时间显示出来，个人觉得这样又很大的意义。 2，每首歌曲能不能添加一个类似于彩签的功能，这样让人们添加这首歌的时候可以顺手写下几句话，表达一下内心的情感。 望采纳，谢谢', '用酷狗也三年了，也见证了酷狗许多大大小小的变化。但是，我想提几点建议，希望采纳。 1，可不可以把每一首歌曲添加的时间或者收藏到歌单的时间显示出来，个人觉得这样又很大的意义。 2，每首歌曲能不能添加一个类似于彩签的功能，这样让人们添加这首歌的时候可以顺手写下几句话，表达一下内心的情感。 望采纳，谢谢', '', 0, 10080, '2020-06-26 19:19:06', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (241, 43, 1, '', NULL, NULL, '去年刚刚下载番茄小说就彻底爱上了，里面的书很多，重点是都是免费的！无聊时候翻一翻还可以挣点零花钱（哈哈哈），然后我还给身边的朋友也推荐了番茄。总的来说，要是能有更多书的版权再这里面就更好了！', '去年刚刚下载番茄小说就彻底爱上了，里面的书很多，重点是都是免费的！无聊时候翻一翻还可以挣点零花钱（哈哈哈），然后我还给身边的朋友也推荐了番茄。总的来说，要是能有更多书的版权再这里面就更好了！', '', 0, 10064, '2020-06-27 13:19:52', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (242, 31, 1, '', NULL, NULL, '#给喜马拉雅一点建议#\r\n声音太小！开车开导航和喜马一起听，需要把汽车音响开特别大声才能听清楚喜马的声音，结果，导航一播报，显得声音特别大！ 喜马的开发测试人员是不是没考虑到开车听喜马这个场景呢？希望能把开车的用户考虑进去，谢谢！', '#给喜马拉雅一点建议#\r\n声音太小！开车开导航和喜马一起听，需要把汽车音响开特别大声才能听清楚喜马的声音，结果，导航一播报，显得声音特别大！ 喜马的开发测试人员是不是没考虑到开车听喜马这个场景呢？希望能把开车的用户考虑进去，谢谢！', '', 0, 10064, '2020-06-27 13:20:15', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (243, 54, 1, '', NULL, NULL, '下厨房难用的我快要放弃了，你们的推荐全是用算法来推的，我怎么刷新都是我以前做过的菜品。我希望你们可以不根据我的喜好来，如果下厨房不是一个菜单的话他就失去了我用它的初衷。我现在用下厨房，完全找不到做饭的灵感了', '下厨房难用的我快要放弃了，你们的推荐全是用算法来推的，我怎么刷新都是我以前做过的菜品。我希望你们可以不根据我的喜好来，如果下厨房不是一个菜单的话他就失去了我用它的初衷。我现在用下厨房，完全找不到做饭的灵感了', '', 0, 10064, '2020-06-27 13:20:43', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (244, 70, 1, '', NULL, NULL, '吹爆番茄TODO，真的非常实用了，学习效率得到了显著提高，而且这个画风我真的爱了。不过希望开发者能加一个功能：代办完成后就直接消失，而不是等到第二天消失。这个可以加到设置中让用户自己选择（个人意见，这样能更清晰的看到没有完成的事项，而且看到代办清零时会有很大的成就感）。希望采纳建议，谢谢！', '吹爆番茄TODO，真的非常实用了，学习效率得到了显著提高，而且这个画风我真的爱了。不过希望开发者能加一个功能：代办完成后就直接消失，而不是等到第二天消失。这个可以加到设置中让用户自己选择（个人意见，这样能更清晰的看到没有完成的事项，而且看到代办清零时会有很大的成就感）。希望采纳建议，谢谢！', '', 0, 10064, '2020-06-27 13:21:25', '2020-08-20 12:09:54', NULL, NULL);
