INSERT INTO `fb_posts` VALUES (254, 38, 1, '', NULL, NULL, '浮生为卿歌建议，开发者康康我！\n当我看到这个游戏时我是非常高兴的，起初觉得非常好玩，但是玩的时间久了，就发现别人都充钱了，又有坐骑又有好看的衣服，但是我买不起啊，每天都看到充钱的人在那里跑来跑去，我都快受不了啦！虽然我没有充钱，但是差别也不能差别这么大吧？搞得我都不想玩了！中间删了好几次，都是因为充钱的问题，当然，我也看到了你们开发者的努力，但是能不能不要这么大的差别啊！我是真的受不了啊！我也不是让这个游戏都免费，但是能不能不要有的只有充钱才能得到啊，你们可不可以让不充钱的玩家多玩点时间，攒碎片也行啊。望采纳，辛苦了，谢谢🙏', '浮生为卿歌建议，开发者康康我！\n当我看到这个游戏时我是非常高兴的，起初觉得非常好玩，但是玩的时间久了，就发现别人都充钱了，又有坐骑又有好看的衣服，但是我买不起啊，每天都看到充钱的人在那里跑来跑去，我都快受不了啦！虽然我没有充钱，但是差别也不能差别这么大吧？搞得我都不想玩了！中间删了好几次，都是因为充', '', 0, 9979, '2020-06-28 12:50:14', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (255, 39, 1, '', NULL, NULL, '#我功夫特牛一些建议#\n角色太少了\n作为体验者只玩男的不好，魔教公主只能试用，葵花宝典的那个女生也不是真正的皮肤，请多加点皮肤好吗\n首饰不合理 \n饰可以刷出新秘籍，以为可以刷出闪避了，结果刷出纯阳无极功加血量，最后两关和第四关开始的大侠章节是怎么也打不过的，因为内功属性已经升满了，已经没有提升空间了\n没办法观看广告\n以前还可以靠着看广告快去回刷章节，现在广告看不了，白银宝箱没法拿，还少了一条命，这让我已经不再想玩下去了，希望技术人员看到。解决一下', '#我功夫特牛一些建议#\n角色太少了\n作为体验者只玩男的不好，魔教公主只能试用，葵花宝典的那个女生也不是真正的皮肤，请多加点皮肤好吗\n首饰不合理 \n饰可以刷出新秘籍，以为可以刷出闪避了，结果刷出纯阳无极功加血量，最后两关和第四关开始的大侠章节是怎么也打不过的，因为内功属性已经升满了，已经没有提升空间了', '', 0, 9979, '2020-06-28 12:51:04', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (256, 40, 1, '', NULL, NULL, '#字走三国\n强化+n的关卡任务，困扰其实主要在于“溃败”机制，军营等级升高之后，电脑无限溃败（大量掉血），导致实际可进行的回合数变少，无法招募足够卡牌完成任务。（相信部分单机爆肝强迫症收集癖玩家也希望能看到有10张+10卡牌上场搏斗，但现在的游戏回合数远远不可能完成）\n所以，建议在设置中添加“快速游戏”勾选项（例如:对局是否触发溃败等），这样的话:\n1.对于时间少的玩家，依然可以继续进行快速游玩;\n2.对于喜欢爆肝，有强迫症的玩家（我也是之一），也有足够的回合完成任务，或者满足收集癖。', '#字走三国\n强化+n的关卡任务，困扰其实主要在于“溃败”机制，军营等级升高之后，电脑无限溃败（大量掉血），导致实际可进行的回合数变少，无法招募足够卡牌完成任务。（相信部分单机爆肝强迫症收集癖玩家也希望能看到有10张+10卡牌上场搏斗，但现在的游戏回合数远远不可能完成）\n所以，建议在设置中添加“快速游', '', 0, 9979, '2020-06-28 12:52:42', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (257, 41, 1, '', NULL, NULL, '众生游不错，但还有很多要完善，想说一下关于游戏的一些理解：\n1.关于心情值，玩了几个档，发现心情值是最难补好的一个状态，基本上都保持在黄条，就算能加心情值，加的也很慢，而且掉的快，然后又保持在黄条。\n2.关于前期幼儿园的培养，前期给的3科教材只有一本，另外的书的来源就是一次去广场再就是家里，一般都会把家里书都卖了在广场买书，因为书都有可能会提前看完，有时候开局不好，主角偏学严重导致到小学可能都不能三科达到一星。建议在初期的场景小摊里能有完整的启蒙书。\n3.人物关系可以好好完善一下，现在好像是不能和别的NPC交朋友吧，现在NPC太多，和NPC交谈有了最基础的关系但是关系列表并不显示，希望能出个各个大地点的NPC列表\n4.跳舞绘画健身，这些爱好给的属性太少，而且要长时间学才能跳出加属性的条，导致整天整天就是在刷属性，而且还不能各个方面顾及，只能偏重，其它的娱乐也会变少\n5.关于不同爱好，可以在一定岁数以后开启，然后随岁数增长黄条累积会加快一点，做的更加真实一点\n（建议下调刷属性的比例，多加一些另外的内容，会使游戏更加自由）\n希望策划大大将众生做的越来越好，加油哦', '众生游不错，但还有很多要完善，想说一下关于游戏的一些理解：\n1.关于心情值，玩了几个档，发现心情值是最难补好的一个状态，基本上都保持在黄条，就算能加心情值，加的也很慢，而且掉的快，然后又保持在黄条。\n2.关于前期幼儿园的培养，前期给的3科教材只有一本，另外的书的来源就是一次去广场再就是家里，一般都会', '', 0, 9976, '2020-06-28 12:54:18', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (258, 42, 1, '', NULL, NULL, '花店物语画风可爱治愈，玩法休闲，目前还挺喜欢这个游戏。\n一些小bug也不多说了，就说一个让我有点蛋疼的地方叭……就是种植了植物之后，因为每种植物的成熟时间不一样，然后移出植物和收取植物的键在一起，所以有时候我收取花朵点到了还在成长的植物很容易手快点成移除……好几次了，还有两次一不小心把珍惜植物移出了，都是我家老鼠辛辛苦苦带回来的，移除了就没了QAQ。可以改一下这个移出和收取的位置设计吗？这两个在一起真的很容易手快移除。或者那些被移出作物可以返还一点种子补偿也好呀，不然手快了真的没地哭。', '花店物语画风可爱治愈，玩法休闲，目前还挺喜欢这个游戏。\n一些小bug也不多说了，就说一个让我有点蛋疼的地方叭……就是种植了植物之后，因为每种植物的成熟时间不一样，然后移出植物和收取植物的键在一起，所以有时候我收取花朵点到了还在成长的植物很容易手快点成移除……好几次了，还有两次一不小心把珍惜植物移出了', '', 0, 9976, '2020-06-28 12:54:50', '2020-08-20 12:09:54', NULL, NULL);
