INSERT INTO `fb_posts` VALUES (289, 86, 1, '', NULL, NULL, '发现网易云课堂下载有细节处理不好。 1、内容有章节，但不允许章节批量下载。要一个一个戳过去，好麻烦。 2、下载时关闭手机会导致进程被杀死，再次启动后下载记录竟然没有了，要重新选一个下载的内容，其他的才自动一个接一个的下载，而且这个神奇的队列是不可见的。 3、允许流量下载后，每次下载都要提醒在用流量下载，建议把这个提示防到设置里让用户自己选择。', '发现网易云课堂下载有细节处理不好。 1、内容有章节，但不允许章节批量下载。要一个一个戳过去，好麻烦。 2、下载时关闭手机会导致进程被杀死，再次启动后下载记录竟然没有了，要重新选一个下载的内容，其他的才自动一个接一个的下载，而且这个神奇的队列是不可见的。 3、允许流量下载后，每次下载都要提醒在用流量下', '', 0, 9554, '2020-07-03 09:47:53', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (290, 87, 1, '', NULL, NULL, '@荔枝FM\n新版真的很心累，用荔枝FM这么多年，一直很喜欢荔枝的设计，但是这个新版，不知道为什么要搞的这么花里胡哨，现在直播很热就改成这个样子，要看直播可以下专门的直播软件，胡乱跟风真的很影响用户体验，不想升级可是根本找不到原来的版本！！！要听电台，只不过想好好放松，原来简洁的设计，方便明了，现在改的，眼花缭乱。其实电台根本不需要做这些无意义的改变，保持初心才能长久。', '@荔枝FM\n新版真的很心累，用荔枝FM这么多年，一直很喜欢荔枝的设计，但是这个新版，不知道为什么要搞的这么花里胡哨，现在直播很热就改成这个样子，要看直播可以下专门的直播软件，胡乱跟风真的很影响用户体验，不想升级可是根本找不到原来的版本！！！要听电台，只不过想好好放松，原来简洁的设计，方便明了，现在改', '', 0, 9554, '2020-07-03 10:03:03', '2020-08-20 12:09:54', NULL, NULL);
