INSERT INTO `fb_posts` VALUES (296, 95, 1, '', NULL, NULL, '@嘿市app\n使用了一段时间，提出三点建议，望采纳：\n1、比起闲鱼上的极品买家，这个平台相对的买家素质要高一些 议价的功能建议让卖家选择是否支持，如卖家不支持议价的可以手动关闭出价功能，有效屏蔽低素质以议价为乐的买家\n2、 本人使用的过程中遇到了bug，无法阅读某一件商品的买家询问，一直有未读消息卡住，但无法在列表中看到与买家的对话框。\n3、app内没有客服，需要加wx，但是客服基本没有回复，或者极其缓慢，且至今没有解决我遇到的bug。', '@嘿市app\n使用了一段时间，提出三点建议，望采纳：\n1、比起闲鱼上的极品买家，这个平台相对的买家素质要高一些 议价的功能建议让卖家选择是否支持，如卖家不支持议价的可以手动关闭出价功能，有效屏蔽低素质以议价为乐的买家\n2、 本人使用的过程中遇到了bug，无法阅读某一件商品的买家询问，一直有未读消息卡', '', 0, 9481, '2020-07-04 20:35:26', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (297, 96, 1, '', NULL, NULL, '@猫头鹰和灯塔\n看到了很多很多可以改进的地方：\n1，画质。游戏中只有三个场景，门前，屋子里和后院。虽然有四季春夏寒暑天气，但是这个画质我还是不满意，如果可以进一步提升最好。\n此外可不可以给那些旅客一个进门的画面啊，光谈话感觉怪怪的。\n2，伯爵和它的工具人？能不能给工具人一点戏份啊，除了刻木头之外连影子都没有，真的很不舒服。\n3，逻辑问题，在游戏中，以木头作为货币，我总是觉得怪怪的。尤其是拿木头做香水，还有木雕是100/150块小木头拼起来的，额。另外，院子里的木头从哪来的？没有明确的逻辑指示（也许我还没玩到吧）。以及，如果没有木雕就找不到灯塔，那么那些信是怎么来的？没有交代清楚啊。', '@猫头鹰和灯塔\n看到了很多很多可以改进的地方：\n1，画质。游戏中只有三个场景，门前，屋子里和后院。虽然有四季春夏寒暑天气，但是这个画质我还是不满意，如果可以进一步提升最好。\n此外可不可以给那些旅客一个进门的画面啊，光谈话感觉怪怪的。\n2，伯爵和它的工具人？能不能给工具人一点戏份啊，除了刻木头之外连影', '', 0, 9481, '2020-07-04 20:36:12', '2020-08-20 12:09:54', NULL, NULL);
