INSERT INTO `fb_posts` VALUES (423, 14, 1, '', NULL, NULL, '@Pendo笔记\n1.希望一个待办清单里的事项，长按后可以移动顺序，因为我一旦不小心把它打勾，它就会跑到最后方，即便我取消打勾它也不会回到原来的位置，但每个事项我是按时间顺序创建的，这样就显得很杂乱 2.希望待办清单里每一个事项都可以单独设置提醒时间。比如我有一个“日日清”的待办清单，里面有每天6:30-23点的所有待办事项，比如：1、6:30起床完成3组卷腹；2、8:00前检查邮件并回复。我就希望软件在6:30时给一个弹窗说要起床完成卷腹了，8:00时又一个弹窗说要回复邮件了 3.评论里有人提到待办事项未完成的情况，当天待办事项没完成，第二天就直接被覆盖了，我找不到前一天的完成情况。我在一周后写周总结的时候，我没办法知道这一周里每一天我都完成了哪些事项，没有完成哪些事项 4.希望增加的新功能：待办事项与番茄工作法的联动。我在创建一个9:00开始看书的待办事项后，希望能跳出一个番茄钟，迅速让我进入学习状态。 可能说的有点多，pendo也帮了我很多，但希望pendo越来越好，不仅是一款优秀的记录软件，更要是一种生产工具。知道对于作者的小团队来说可能很难，但是会一直支持下去，已充电鼓励。', '@Pendo笔记\n1.希望一个待办清单里的事项，长按后可以移动顺序，因为我一旦不小心把它打勾，它就会跑到最后方，即便我取消打勾它也不会回到原来的位置，但每个事项我是按时间顺序创建的，这样就显得很杂乱 2.希望待办清单里每一个事项都可以单独设置提醒时间。比如我有一个“日日清”的待办清单，里面有每天6:', '', 0, 1, '2020-07-13 09:12:43', '2020-07-13 09:13:26', '2020-07-13 09:13:26', NULL);
