INSERT INTO `fb_posts` VALUES (564, 19, 1, '', NULL, NULL, '@iSoul\n经过我一段小测试后，发现无论开启任何报警模式，警报响了后，不用输入密码，只要双击两次小圆点，打开任务管理器后，把你们的程序关闭，就可以退出警报了，根本无法起到保护作用，希望开发者能杜绝关闭程序来起到更好，更完善的保护功能，再补充一个建议，希望能提供一个设置选项，就是延时报警，比如我设置了口袋模式开启后，每次我从口袋拿出来都要先报警再解除报警，如果有延时报警，我可以设定几秒的时间，只要我在设定好的时间内解除就不会报警，这样我在路上或者在一些公共场所就不会看个信息什么的都会骚扰到其他人。希望我的建议能接纳并实现。', '@iSoul\n经过我一段小测试后，发现无论开启任何报警模式，警报响了后，不用输入密码，只要双击两次小圆点，打开任务管理器后，把你们的程序关闭，就可以退出警报了，根本无法起到保护作用，希望开发者能杜绝关闭程序来起到更好，更完善的保护功能，再补充一个建议，希望能提供一个设置选项，就是延时报警，比如我设置', '', 0, 6371, '2020-07-18 09:15:10', '2020-08-20 12:09:54', NULL, NULL);
