INSERT INTO `fb_posts` VALUES (580, 362, 1, '', NULL, NULL, '@TOPYS \n阅读文章时评论栏一直在底部很影响视觉与阅读习惯，可不可以考虑将评论栏做成浮现（下滑时栏目消失上滑时栏目出现）； 灵感首页上部图片占据近一半屏幕感觉视觉比例不太协调（参考手机为iPhone 4.7寸，可以把上部图片比例缩小），底部下滑出现多个不同频道感觉排版上较突兀，可以考虑分频道设计； 干货满满的app，期待更好的你。', '@TOPYS \n阅读文章时评论栏一直在底部很影响视觉与阅读习惯，可不可以考虑将评论栏做成浮现（下滑时栏目消失上滑时栏目出现）； 灵感首页上部图片占据近一半屏幕感觉视觉比例不太协调（参考手机为iPhone 4.7寸，可以把上部图片比例缩小），底部下滑出现多个不同频道感觉排版上较突兀，可以考虑分频道设计', '', 0, 6290, '2020-07-18 17:14:44', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (581, 436, 1, '', NULL, NULL, '@ONE·一个\n作为一名one的忠实读者，4.0版本是我用过最辣鸡的版本， 原因如下：1，被藏起来的个人中心，和“设置”，和其他广大读者一样，如果不看评论里有人说左滑会出现个人中心，我还真找不着呢……2，版面问题，（说句心里话，这是谁改的排版，粗来！我想打你！）从前的阅读版本是把短篇，连载和问题分开放的，清晰明了，方便翻阅，现在混在一块，哎！染马骨东滴（陕西话意思是说乱七八糟，一团浆糊）……3，努力配音的马小橙，和李荟莹去哪了？短篇的配音小喇叭标志找不到啊……4，不是说有电台么？找不到啊！在哪啊！？还想继续吐槽，无奈时间有限，该睡觉了……复杂的世界，一个就够了…………', '@ONE·一个\n作为一名one的忠实读者，4.0版本是我用过最辣鸡的版本， 原因如下：1，被藏起来的个人中心，和“设置”，和其他广大读者一样，如果不看评论里有人说左滑会出现个人中心，我还真找不着呢……2，版面问题，（说句心里话，这是谁改的排版，粗来！我想打你！）从前的阅读版本是把短篇，连载和问题分开', '', 0, 6290, '2020-07-18 17:16:36', '2020-08-20 12:09:54', NULL, NULL);
