INSERT INTO `fb_posts` VALUES (856, 655, 1, '', NULL, NULL, '@网易云音乐 网易云这几年的歌确实是版权太少了，我每次看电影看电视剧发现一些旋律好听的部分就会自动去网易云搜歌单，每次开开心心输入电影电视剧名字搜，加载过后的歌曲让我分不清原版和翻版，有的没有版权仅仅只有翻版，去找原版专辑的时候里面很多歌都没有版权呈灰色了，其实蛮失望的吧，我承认网易云在小众歌曲方面做的不错，而且看网易云评论也是一件开心的事，但是我不是一个只爱听小众音乐的人，我的内存也没那么多，不想下好几个音乐软件，其实卸完以后心里竟然还是第一次这么舍不得一个软件，证明网易云确实用心了，有些难熬的日子里也在网易云里释放过，我觉得我应该还是会下回来的，不过不是现在', '@网易云音乐 网易云这几年的歌确实是版权太少了，我每次看电影看电视剧发现一些旋律好听的部分就会自动去网易云搜歌单，每次开开心心输入电影电视剧名字搜，加载过后的歌曲让我分不清原版和翻版，有的没有版权仅仅只有翻版，去找原版专辑的时候里面很多歌都没有版权呈灰色了，其实蛮失望的吧，我承认网易云在小众歌曲方面', '', 0, 3864, '2020-07-29 20:13:49', '2020-08-20 12:09:54', NULL, NULL);
