INSERT INTO `fb_posts` VALUES (891, 560, 1, '', NULL, NULL, '@知乎 以前我很喜欢在知乎里面搜好看的壁纸呀、图片呀，还有关于考试的一些问题，会有很多可爱的人回答，我就负责疯狂收图～不知道从什么时候开始，知乎里面就有人在恶意诋毁他人，他们像一群恶心的苍蝇，疯狂的、没有下限的攻击别人？？仿佛你不这样做，不赞同他们就是“敌人”…我不懂…我仔细想了想，也问过身边的朋友们，“如果你不喜欢一位明星，你会去时刻关注他，时刻去发表关于他的言论吗？”答案是不会。很简单，对于正常人来讲，对于不喜欢的人肯定会远离，而不是比粉丝还积极的去关注他。没错，这些人是收钱办事的。然而他们在收钱办事，影响的却是普通人群，带坏的是未成年人的身心健康，污染的是网络环境。人人都有发言的权利，但是污蔑、造谣惑众…这些难道不应该得到制止？拒绝网络暴力！', '@知乎 以前我很喜欢在知乎里面搜好看的壁纸呀、图片呀，还有关于考试的一些问题，会有很多可爱的人回答，我就负责疯狂收图～不知道从什么时候开始，知乎里面就有人在恶意诋毁他人，他们像一群恶心的苍蝇，疯狂的、没有下限的攻击别人？？仿佛你不这样做，不赞同他们就是“敌人”…我不懂…我仔细想了想，也问过身边的朋友', '', 0, 3577, '2020-07-30 18:37:36', '2020-08-20 12:09:54', NULL, NULL);
