INSERT INTO `fb_posts` VALUES (932, 562, 1, '', NULL, NULL, '@欢乐斗地主， 在斗地主挑战赛中，每轮最终晋级之前务必增加在线确认环节，不然等待时间过长很多人就离开了！还有，如果一个玩家挂机那下把就应该直接淘汰！为什么还要让他继续玩？！我们还要和这个僵尸玩家连玩3局！斗地主玩的就是配合，如果有人挂机基本就是纯靠天在玩！到后期底分那么大！你们就那么不重视玩家体验吗！优化这个设置从技术上来说根本不难吧！为什么一个玩家如果欢乐豆突然不足了可以直接淘汰，挂机就不行！技术上来说是一样的吧！就是增加个设置！希望采纳', '@欢乐斗地主， 在斗地主挑战赛中，每轮最终晋级之前务必增加在线确认环节，不然等待时间过长很多人就离开了！还有，如果一个玩家挂机那下把就应该直接淘汰！为什么还要让他继续玩？！我们还要和这个僵尸玩家连玩3局！斗地主玩的就是配合，如果有人挂机基本就是纯靠天在玩！到后期底分那么大！你们就那么不重视玩家体验吗', '', 0, 3213, '2020-08-02 17:56:42', '2020-08-20 12:09:54', NULL, NULL);
