INSERT INTO `fb_posts` VALUES (936, 538, 1, '', NULL, NULL, 'UC浏览器用了很久，到最后还是选择脱坑，选择使用系统自带的浏览器。为什么不想使用uc？虽然我基本不看uc里的头条新闻资讯，但是每次打开，看到主页显示推送的内容都是一些俗不可耐、标题党、各种有关美女、小三、八卦、两性的有点黄色色彩等性暗示内容，就很不舒服。用uc的主要用途是使用里面的百度搜索工具，不去看uc头条推送的内容，却一直给我推送这种低俗xxxxx的内容，各种反馈拉黑方式都不管用。俗话说眼不见为净，心就不烦，也不会不舒服。所以注销卸载了，再见。', 'UC浏览器用了很久，到最后还是选择脱坑，选择使用系统自带的浏览器。为什么不想使用uc？虽然我基本不看uc里的头条新闻资讯，但是每次打开，看到主页显示推送的内容都是一些俗不可耐、标题党、各种有关美女、小三、八卦、两性的有点黄色色彩等性暗示内容，就很不舒服。用uc的主要用途是使用里面的百度搜索工具，不去', '', 0, 3203, '2020-08-02 21:27:59', '2020-08-20 12:09:54', NULL, NULL);
