INSERT INTO `fb_posts` VALUES (938, 463, 1, '', NULL, NULL, '@北斗导航 定位精度不错，不过不够智能，今天测试了一下，导航只会按设定好的路线导航，不会重新设计新的路线，半路中选择了另外条路线，但导航会在下个路口时提示按原设定路线走，那怕目的地就在前方了，这样会误导的...\n并且感觉嵌入了高德的东西，没看到北斗哪里体现了...', '@北斗导航 定位精度不错，不过不够智能，今天测试了一下，导航只会按设定好的路线导航，不会重新设计新的路线，半路中选择了另外条路线，但导航会在下个路口时提示按原设定路线走，那怕目的地就在前方了，这样会误导的...\n并且感觉嵌入了高德的东西，没看到北斗哪里体现了...', '', 0, 3192, '2020-08-03 16:56:35', '2020-08-20 12:09:54', NULL, NULL);
