INSERT INTO `fb_posts` VALUES (962, 538, 1, '', NULL, NULL, '番茄小说能观察和发现很多有趣的小说，平时也会推荐很多有趣的比较贴近我们自己的阅读偏向。 主页也会有视频版的小说介绍。每个作者的书风格都不相同，有不同的构架，看个人口味。还可以下载全本，加入书架，书评即书的介绍让你能快速明白内容方向。不过还有点缺点，一个是语音朗读音色和读书的开始，阅读时，每次都是从一篇，一章的开头开始读，当看到中间时不方便阅读。另外，语音读时没有设置阅读的内容，只能听到在读，不注意就找不到了。', '番茄小说能观察和发现很多有趣的小说，平时也会推荐很多有趣的比较贴近我们自己的阅读偏向。 主页也会有视频版的小说介绍。每个作者的书风格都不相同，有不同的构架，看个人口味。还可以下载全本，加入书架，书评即书的介绍让你能快速明白内容方向。不过还有点缺点，一个是语音朗读音色和读书的开始，阅读时，每次都是从一', '', 0, 3086, '2020-08-03 22:40:17', '2020-08-20 12:09:54', NULL, NULL);
