INSERT INTO `fb_posts` VALUES (1002, 275, 1, '', NULL, NULL, '一起学网校\n阴阳怪气来了，太好了，可以在我的暑假自由生活中给我带来学习，现在可以线下教学了，期末考试完后学生容易懒散，这个课程在假期给学生增添乐趣，还能边学习边放假，简直是劳逸结合啊，学校的做法实在是太赞了，有了这个网课后，我终于可以每天早睡早起啦，游戏也可以用网课来代替，这样一来，每天早早来上网课，吃饱午饭午睡后上网课，下午上网课，到晚上，洗完澡再写一下暑假作业，就可以睡觉啦，真是充实的一天，全有老师安排的  我们中国实在是太厉害了!对了，我是伏拉夫，我不会讲英语，我会讲汉语，我爱中国!\n', '一起学网校\n阴阳怪气来了，太好了，可以在我的暑假自由生活中给我带来学习，现在可以线下教学了，期末考试完后学生容易懒散，这个课程在假期给学生增添乐趣，还能边学习边放假，简直是劳逸结合啊，学校的做法实在是太赞了，有了这个网课后，我终于可以每天早睡早起啦，游戏也可以用网课来代替，这样一来，每天早早来上网课', '', 0, 2896, '2020-08-04 19:33:29', '2020-08-20 12:09:54', NULL, NULL);
