INSERT INTO `fb_posts` VALUES (1023, 73, 1, '', NULL, NULL, '携程，对它的订酒店服务太过失望，作为一个提供准确酒店信息，给旅客提供便利的软件，他确实有点失败且管理并不到位，酒店在软件背后阴奉阳违，他毫不知情。比如有些酒店说标准间降价15元快来抢订，其实这些降价的挂在软件上预订的标准间，大多是有瑕疵、物不所值的、差劲的房间（旅客又不是差钱，我宁愿不要减价也要住一个真实的，物有所值的酒店。有些180价位的酒店连沐浴喷头都是坏的，有些连门都锁不上，有些说有免费停车场实际上就让你停在路边）或者说根本就不是同一间房（有些旅店在一个地方开了很多分店有的好，有的差它挂网上的图片是好房间，但实际上让你住的是差房间）还有一些酒店在你预订之后给你打电话告诉你，你订的房间没有了，只有某个价位的房间了（一般都要贵的多，就是故意先用便宜价吸引消费者，之后再故意抬价）以上所举事例皆为真实发生有些是亲身经历，有些是朋友家人吐槽。有些人可能要说这不是携程的错什么什么之类的，但是我只想说携程作为一个平台，应该尽自己的责任和义务，管理一下使用此软件的酒店 起码定期确认或抽样调查一下酒店提供的信息是否真实，我每次订酒店都提心吊胆，真的真的很不方便而且住得不好很扫兴。酒店价位太低不敢订，价位适中的也要选了又选还可能定不到好的，像三四百的酒店肯定好，但作为中产阶级也不能出游时每天都订这个价吧。', '携程，对它的订酒店服务太过失望，作为一个提供准确酒店信息，给旅客提供便利的软件，他确实有点失败且管理并不到位，酒店在软件背后阴奉阳违，他毫不知情。比如有些酒店说标准间降价15元快来抢订，其实这些降价的挂在软件上预订的标准间，大多是有瑕疵、物不所值的、差劲的房间（旅客又不是差钱，我宁愿不要减价也要住一', '', 0, 2866, '2020-08-04 20:08:49', '2020-08-20 12:09:54', NULL, NULL);
