INSERT INTO `fb_posts` VALUES (1048, 720, 1, '', NULL, NULL, '在公司用电脑上的微信发给自己一个word文档，周末回家把这个文档写完了，又发给自己到手机微信上，周一来办公室发现微信里这个文档还是和我公司电脑里周五的内容一样。\n好像手机微信收藏了这个文件，如果电脑本地有和他同名的文件，打开微信里面这个文件就自动变成了本地的那个文件？这个是bug嘛还是本来就这样的？', '在公司用电脑上的微信发给自己一个word文档，周末回家把这个文档写完了，又发给自己到手机微信上，周一来办公室发现微信里这个文档还是和我公司电脑里周五的内容一样。\n好像手机微信收藏了这个文件，如果电脑本地有和他同名的文件，打开微信里面这个文件就自动变成了本地的那个文件？这个是bug嘛还是本来就这样的？', '', 0, 2664, '2020-08-05 16:21:35', '2020-08-20 12:09:54', NULL, NULL);
