INSERT INTO `fb_posts` VALUES (1051, 92, 1, '', NULL, NULL, '钉钉奇葩的错误提示\n\n打开钉钉后除了OA工作台首页其他功能一切正常。\n工作台首页的提示为：\n出错了！请稍后再试\n您的网络出现异常，如果只有您有这个问题，可能是您本机的网络设置问题；如果您身边所有人都有这个问题，可能是所在的网络的设置问题，请联系IT管理员来排查此问题。\n打开 https://taou.cn/xk4x8 失败\n详细错误信息:-106 ERR_INTERNET_DISCONNECTED\n\n明明网络正常为啥报网络连接错误？\n将上述链接在chrome浏览器中打开通过F12跟踪发现控制台报notInDingTalk，网络都是200正常返回码。\n那表示页面能正常访问，但只能在钉钉里打开，于是怀疑钉钉用黙认的浏览器打不开。检查黙认浏览器，由360浏览器切换到chrome后一切正常。\n奇葩的错误提示，浪费用户时间。', '钉钉奇葩的错误提示\n\n打开钉钉后除了OA工作台首页其他功能一切正常。\n工作台首页的提示为：\n出错了！请稍后再试\n您的网络出现异常，如果只有您有这个问题，可能是您本机的网络设置问题；如果您身边所有人都有这个问题，可能是所在的网络的设置问题，请联系IT管理员来排查此问题。\n打开 https://taou', '', 0, 2660, '2020-08-05 16:26:27', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1052, 93, 1, '', NULL, NULL, '就刚刚，点美团外卖。\n支付时，发现会员到期了。取消支付，转而购买会员。奇迹出现了。刚刚未支付的订单，在订单列表里，正处于倒计时状态，也恰恰是这个倒计时状态的订单，变成了支付的恶梦。。。只要从美团首页，点击订单，进入订单页面，app就无响应。。。强制关闭。重启手机也无用。最终只能等到该订单倒计时结束自动取消该订单。app回归正轨，又能继续开心的下订单了。。。应该是线程问题哈。\n还有另外一个问题，每次支付时，支付宝不能正确回调，都需要app退回后台，重新打开。才会进入正常弹窗以及后续流程。。。', '就刚刚，点美团外卖。\n支付时，发现会员到期了。取消支付，转而购买会员。奇迹出现了。刚刚未支付的订单，在订单列表里，正处于倒计时状态，也恰恰是这个倒计时状态的订单，变成了支付的恶梦。。。只要从美团首页，点击订单，进入订单页面，app就无响应。。。强制关闭。重启手机也无用。最终只能等到该订单倒计时结束自', '', 0, 2655, '2020-08-05 16:29:51', '2020-08-20 12:09:54', NULL, NULL);
