INSERT INTO `fb_posts` VALUES (1055, 95, 1, '', NULL, NULL, '关于探探，你们有谁用过探探吗？\n前几天刷抖音看到推荐探探，突然想到之前下载过，就想着下载回来看看，没想到一下载回来就被永久封号！打客服电话咨询，就说违规了七条内的动作，比如发广告了，比如发敏感字眼了！我说七条我都没有做过，他们说具体原因查询不到，还涉及公司制度不给告诉具体违规行为，我说你们这不是店大欺客吗？就想问问有没有遇到同样情况的童鞋们，所有录音我都有，我敢说我真的没做违规的事情啊。', '关于探探，你们有谁用过探探吗？\n前几天刷抖音看到推荐探探，突然想到之前下载过，就想着下载回来看看，没想到一下载回来就被永久封号！打客服电话咨询，就说违规了七条内的动作，比如发广告了，比如发敏感字眼了！我说七条我都没有做过，他们说具体原因查询不到，还涉及公司制度不给告诉具体违规行为，我说你们这不是店大', '', 0, 2644, '2020-08-05 18:57:06', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1056, 96, 1, '', NULL, NULL, '东航随心飞怎么回事啊。周六要飞上海，希望早点走，APP里能订的经济舱只有12:30的票。一旦订好了票，前面9:30和11:30的经济舱就出现了。等我退了12:30的，这两个经济舱就没了。来回两三次，都是这样……', '东航随心飞怎么回事啊。周六要飞上海，希望早点走，APP里能订的经济舱只有12:30的票。一旦订好了票，前面9:30和11:30的经济舱就出现了。等我退了12:30的，这两个经济舱就没了。来回两三次，都是这样……', '', 0, 2642, '2020-08-05 19:00:31', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1057, 725, 1, '', NULL, NULL, '陌声\n骗子软件！里面都是拖，进去就有人主动跟你聊天，都是打着“处对象”或者“处朋友”的幌子给你聊天，聊天需要金币，每发一句消息都会扣金币，而且每次扣的金币数量还不一样，发几句消息金币就没啦，需要充值，说白了就是骗钱的！这种软件就应该让它下架，少坑点人！骗子！骗子！骗子！\n', '陌声\n骗子软件！里面都是拖，进去就有人主动跟你聊天，都是打着“处对象”或者“处朋友”的幌子给你聊天，聊天需要金币，每发一句消息都会扣金币，而且每次扣的金币数量还不一样，发几句消息金币就没啦，需要充值，说白了就是骗钱的！这种软件就应该让它下架，少坑点人！骗子！骗子！骗子！\n', '', 0, 2617, '2020-08-05 22:10:07', '2020-08-20 12:09:54', NULL, NULL);
