INSERT INTO `fb_posts` VALUES (1059, 727, 1, '', NULL, NULL, '韩剧TV\n韩剧tv，从此在我的ipad里消失了！这次韩剧tv更新后，我的ipad竟不能兼容了，太气了！对这个软件爱到不行，以后怎么办啊！！！说ios要9.0以上，我的ipad2符合这个要求，但具体兼容设备里没有写到这个型号，只能盼望ipad的ios可以再升级。', '韩剧TV\n韩剧tv，从此在我的ipad里消失了！这次韩剧tv更新后，我的ipad竟不能兼容了，太气了！对这个软件爱到不行，以后怎么办啊！！！说ios要9.0以上，我的ipad2符合这个要求，但具体兼容设备里没有写到这个型号，只能盼望ipad的ios可以再升级。', '', 0, 2617, '2020-08-05 22:12:48', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1060, 728, 1, '', NULL, NULL, '欢乐方块消\n这个绝对不靠谱，开始他会给你七十块钱让你去看广告，看到后面就是一个广告几分钱，最恶心的是里面的掠夺机制，等你玩儿到九十多块钱的时候，就会疯狂掠夺，你看了几个小时挣两毛，一下就给你掠夺两三毛，反正永远也别想到一百了提现，奉劝大家别浪费时间！！！', '欢乐方块消\n这个绝对不靠谱，开始他会给你七十块钱让你去看广告，看到后面就是一个广告几分钱，最恶心的是里面的掠夺机制，等你玩儿到九十多块钱的时候，就会疯狂掠夺，你看了几个小时挣两毛，一下就给你掠夺两三毛，反正永远也别想到一百了提现，奉劝大家别浪费时间！！！', '', 0, 2617, '2020-08-05 22:14:24', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1061, 729, 1, '', NULL, NULL, '唯品会\n订单修改有问题，1:客户下单后发现尺码选错，不能自己修改； 2:联系客服处理修改尺码，客服回应无法处理，我都不知道那这个客服是干啥的！所以京东，淘宝，拼多多，那个平台不支持修改，就唯品会不支持！ 3:运费问题，退换运费险没有标注清楚！', '唯品会\n订单修改有问题，1:客户下单后发现尺码选错，不能自己修改； 2:联系客服处理修改尺码，客服回应无法处理，我都不知道那这个客服是干啥的！所以京东，淘宝，拼多多，那个平台不支持修改，就唯品会不支持！ 3:运费问题，退换运费险没有标注清楚！', '', 0, 2617, '2020-08-05 22:15:33', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1062, 730, 1, '', NULL, NULL, '识货\n刚开始使用感觉还不错，不过最近一次购物体验极差~~~首先客服就特别慢，排队比去银行叫号都慢~~其次是物流，下单五天了，物流从江苏到上海，又从上海发回了江苏，我自己不查看，不打电话问客服连个通知都没有，玩呢~~~最后我申请退货，售后来电说物流的问题订单被退回平台，然后说还要的话重新给你发，不要就给取消订单，物流方面需要我承担违约金(语气态度差的要死)~~~~怎么滴我花钱在你们平台买东西你们自己的问题还得我承担责任！！！本来在这个卖服务的时代，商品都一样你家服务差我为什么选你家~~~直接卸载~~~至于其他还没下载的用户自己体会吧~', '识货\n刚开始使用感觉还不错，不过最近一次购物体验极差~~~首先客服就特别慢，排队比去银行叫号都慢~~其次是物流，下单五天了，物流从江苏到上海，又从上海发回了江苏，我自己不查看，不打电话问客服连个通知都没有，玩呢~~~最后我申请退货，售后来电说物流的问题订单被退回平台，然后说还要的话重新给你发，不要就', '', 0, 2617, '2020-08-05 22:16:56', '2020-08-20 12:09:54', NULL, NULL);
