INSERT INTO `fb_posts` VALUES (1064, 732, 1, '', NULL, NULL, '新氧医美\n太夸张了！                                        \n刷快手看到的，可以测试脸型设计发型，就想说下载来试试。app里的魔镜侧脸，太想吐槽了，我用连续测10次，每次都是不一样的，清丽贵妇少女高级白富美女神，😂我也就是拍照时距离差了一点点，全部都给我来一遍，还不带重复的。再来发型设计，我就圆脸，推荐的全是短发，那显得我还是一样圆。太无语😓了。', '新氧医美\n太夸张了！                                        \n刷快手看到的，可以测试脸型设计发型，就想说下载来试试。app里的魔镜侧脸，太想吐槽了，我用连续测10次，每次都是不一样的，清丽贵妇少女高级白富美女神，😂我也就是拍照时距离差了一点点，全部都给我来一遍', '', 0, 2617, '2020-08-05 22:19:44', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1065, 733, 1, '', NULL, NULL, '安居客\n审核制度迷惑，虚假房源众多                                                       \n这个app上中介貌似一个个都挂有审核过的标志，大多都在某些大中介公司名下，问房源信息大多都说是真实有效的。但！我看到的房全部都是营销策略，挂虚假房源骗我过去看房，再以各种理由推脱说房子看不了或者没有了然后带来其它的房源，惯用看房套路来骗人。在平台上咨询一句就问电话，貌似中介行业都是以电话号码来算业绩的，真实信息没一句答复，呵呵。或者就是约好的时间反复放鸽子！ 重点是给一分的理由，举报的房源大多不通过举报，不知道这个平台是不是为骗子做的。希望那些为了业绩利益而不停骗人的中介有时间摸摸自己的良心去哪儿了，还有这种助纣为虐的垃圾平台，希望大家足够警惕，淘汰这种劣币！', '安居客\n审核制度迷惑，虚假房源众多                                                       \n这个app上中介貌似一个个都挂有审核过的标志，大多都在某些大中介公司名下，问房源信息大多都说是真实有效的。但！我看到的房全部都是营销策略，挂虚假房源骗我过', '', 0, 2617, '2020-08-05 22:21:00', '2020-08-20 12:09:54', NULL, NULL);
