INSERT INTO `fb_posts` VALUES (1137, 633, 1, '', NULL, NULL, '识货刚开始使用感觉还不错，不过最近一次购物体验极差。首先客服就特别慢，排队比去银行叫号都慢。其次是物流，下单五天了，物流从江苏到上海，又从上海发回了江苏，我自己不查看，不打电话问客服连个通知都没有，玩呢???最后我申请退货，售后来电说物流的问题订单被退回平台，然后说还要的话重新给你发，不要就给取消订单，物流方面需要我承担违约金(语气态度差的要死)...怎么滴我花钱在你们平台买东西你们自己的问题还得我承担责任！！！', '识货刚开始使用感觉还不错，不过最近一次购物体验极差。首先客服就特别慢，排队比去银行叫号都慢。其次是物流，下单五天了，物流从江苏到上海，又从上海发回了江苏，我自己不查看，不打电话问客服连个通知都没有，玩呢???最后我申请退货，售后来电说物流的问题订单被退回平台，然后说还要的话重新给你发，不要就给取消订', '', 0, 1930, '2020-08-08 14:32:03', '2020-08-20 12:09:54', NULL, NULL);
