INSERT INTO `fb_posts` VALUES (1170, 762, 1, '', NULL, NULL, '掌门太忙剧情一般，节奏感不好，代入感也差。扎堆般的背景介绍和人物出场让我看到了编剧能力的有限。 女主设定没什么讨喜地方，性格也奇奇怪怪的。 男主人设不是我的菜，性格僵硬，强凹人设的感觉，形象很没有深度。有时候行动和思维有点反常。 合理怀疑制作组没有请人类学/心理学/社会学顾问。 美术风格不是很喜欢，过于厚重看起来很老。 声音的技术处理好像有点问题，游戏内声音非常糊，cv大大的音色都快听不出来了。 可玩性有点点差，我还以为会有点模拟经营的元素。 总结：平平无奇，奈何隔壁未名珠玉在前，就显得有点差强人意了。 优点：开服活动力度大，女主的反派掌门设定比较新颖。', '掌门太忙剧情一般，节奏感不好，代入感也差。扎堆般的背景介绍和人物出场让我看到了编剧能力的有限。 女主设定没什么讨喜地方，性格也奇奇怪怪的。 男主人设不是我的菜，性格僵硬，强凹人设的感觉，形象很没有深度。有时候行动和思维有点反常。 合理怀疑制作组没有请人类学/心理学/社会学顾问。 美术风格不是很喜欢，', '', 0, 1649, '2020-08-09 15:52:19', '2020-08-20 12:09:54', NULL, NULL);
