INSERT INTO `fb_posts` VALUES (1278, 606, 1, '', NULL, NULL, '@讯飞输入法，①九键键盘下的GHI键和TUV键失灵问题严重。 这并非我本机问题，因为当我切换到ios自带键盘时，无论我打字多快都不会有任何差错。 但你们讯飞输入法的GHI键和TUV键，尤其GHI键，点击无效情况非常严重，当我打字速度快的时候，几乎毎次都会出现问题，导致我经常经常经常打字错误，又得重新再打一次，非常麻烦。望你们尽快解决此问题，谢谢。 ②接着问题①，还会出现点击无效后键盘格定格的情况，我不明白为什么还会出现这种定格情况，就像年久失修的遥控器，按下去就再也起不来。 ③这个问题是我在评论反馈时出现的。居然能够出现一旦当我输入某段文字，就会出现逐字逐句自动删除的情况。', '@讯飞输入法，①九键键盘下的GHI键和TUV键失灵问题严重。 这并非我本机问题，因为当我切换到ios自带键盘时，无论我打字多快都不会有任何差错。 但你们讯飞输入法的GHI键和TUV键，尤其GHI键，点击无效情况非常严重，当我打字速度快的时候，几乎毎次都会出现问题，导致我经常经常经常打字错误，又得重新', '', 0, 505, '2020-08-14 10:15:38', '2020-08-20 12:09:54', NULL, NULL);
INSERT INTO `fb_posts` VALUES (1279, 525, 1, '', NULL, NULL, '去哪儿旅行，1.通过去哪儿定了酒店，结果到酒店酒店并没有收到订单。客服协调入住退差价，虽然产生不快但此步骤解决了。 2.结果退差价退到了去哪儿账户，账户想要提现，必须用银行卡实名认证，认证后无法取消实名认证。 也就是不让用户提现了呗？一旦提现身份信息就必须留在App上。这种流氓行为实在无力吐槽。 3.最后给的解决方案是用户注销账号，App的错误让用户买单。用户用了多年账户，不帮用户解决问题，让用户注销。', '去哪儿旅行，1.通过去哪儿定了酒店，结果到酒店酒店并没有收到订单。客服协调入住退差价，虽然产生不快但此步骤解决了。 2.结果退差价退到了去哪儿账户，账户想要提现，必须用银行卡实名认证，认证后无法取消实名认证。 也就是不让用户提现了呗？一旦提现身份信息就必须留在App上。这种流氓行为实在无力吐槽。 3', '', 0, 495, '2020-08-14 10:44:56', '2020-08-20 12:09:54', NULL, NULL);
