INSERT INTO `fb_posts_copy1` VALUES (69, 14, 1, '', NULL, NULL, '百度网盘客户端整个关闭了，再打开想重新扫描重复文件，却一直显示加载，网盘你不会后台帮我删文件吧！因为第一次扫描我点了快速清理…后来发现原来会把扫描出来的全部文件都删除，但是找不到暂停的按钮，于是关闭整个客户端，结果就是下图所示！为了扫描重复文件买的超级会员，我真的后悔死了！百度网盘给个说法', '百度网盘客户端整个关闭了，再打开想重新扫描重复文件，却一直显示加载，网盘你不会后台帮我删文件吧！因为第一次扫描我点了快速清理…后来发现原来会把扫描出来的全部文件都删除，但是找不到暂停的按钮，于是关闭整个客户端，结果就是下图所示！为了扫描重复文件买的超级会员，我真的后悔死了！百度网盘给个说法', '', 0, 1235, '2020-06-08 14:51:58', '2020-06-26 13:42:53', '2020-06-26 13:42:53');
