INSERT INTO `fb_posts_copy1` VALUES (76, 14, 1, '', NULL, NULL, '#Agenda开发者看过来\n提一下建议和疑问： 1求中文 2我是拿app记笔记的，希望有在打字中快速插入时间的功能 类似bear。 3不清楚能不能锁定记好的内容不被误修改 4层级太少 不适合分类记录的东西 5并不喜欢用日历这个软件 因为不是想用它弄工作提醒 ，而是用来做时间记录 ，比如哪个时刻我做了什么 。因此日历插入的时间非要手动选择 很麻烦 一年前的日历内容更是无法搜索，所以希望Agenda能独立有自己的时间线编辑。', '#Agenda开发者看过来\n提一下建议和疑问： 1求中文 2我是拿app记笔记的，希望有在打字中快速插入时间的功能 类似bear。 3不清楚能不能锁定记好的内容不被误修改 4层级太少 不适合分类记录的东西 5并不喜欢用日历这个软件 因为不是想用它弄工作提醒 ，而是用来做时间记录 ，比如哪个时刻我做了', '', 0, 1213, '2020-06-08 23:54:31', '2020-06-26 13:41:21', '2020-06-26 13:41:21');
