INSERT INTO `fb_posts_copy1` VALUES (85, 14, 1, '', NULL, NULL, '#希望Journey能匹配到小伙伴\n首先说说游戏本身是有很大的耐玩性。这个游戏里面一开始是在茫茫的大沙漠里面，从目的地（其实就是那座山）飞过来一个流星，掉下来变成主角红袍。然后就是一路走一路吃星星增加围巾的长度。到第二关的时候遇到了一个小伙伴。然后继续走……最后会飞到山顶。走进光芒的时候，主角会变成那个流星，一路飞回去。最后又孤身一人，回到起点。 本来我是用PS4玩的这款游戏，后来在IPad上面看到了这个游戏之后（果断放弃PS4）😂还是熟悉的场景熟悉的红袍，可是没有小伙伴一起…？以为没有匹配到但是又试了几次还是没有（大哭）甚至我在选择关卡到第二关的时候都看见小伙伴在前面了，可是一过去就没了？神马情况？？？？请问是我的问题还是什么情况？不过还是希望陈星汉大大让我们在手机IPad上面也能匹配到小伙伴吧ヾ(´∀｀。ヾ)', '#希望Journey能匹配到小伙伴\n首先说说游戏本身是有很大的耐玩性。这个游戏里面一开始是在茫茫的大沙漠里面，从目的地（其实就是那座山）飞过来一个流星，掉下来变成主角红袍。然后就是一路走一路吃星星增加围巾的长度。到第二关的时候遇到了一个小伙伴。然后继续走……最后会飞到山顶。走进光芒的时候，主角会变成', '', 0, 1152, '2020-06-11 14:43:08', '2020-06-26 13:41:46', '2020-06-26 13:41:46');
INSERT INTO `fb_posts_copy1` VALUES (86, 14, 1, '', NULL, NULL, '网易引进漫威官方漫画app让漫粉很高兴，对比原版本9.99刀美金的会员制来讲，10元会员制对购买力比较低的中国用户很友好，当然9刀之于美国佬和10人民币至于我们来说没差。加上还要有专门团队汉化，运营，工作人员辛苦了💦。下面说说软件现在的缺点。1.人物不全，汉化较慢，估计工作人员也在加班加点的熬，补全是迟早的事。也是时间的事，想看到最新的共生体星球还得自己爬。2.软件似乎有点不稳定，界面卡顿现象是存在的，特别是主界面，不单单是手机端体验有时会有延迟，平板上也是。3.没有设置啊！智能分屏功能是照搬下来的，不能设置关闭或打开或调整浏览全页面的顺序。是不是在等入驻的用户多了时候就有💰和动力给自己加鸡腿了呢？前提是有足够的吸引力嗷，把那些铁粉吸过来。现在国区原版无限软件和汉化软件并存，只是原版的贵价格6倍，而且速度不算太快并且语言不通（不是不能看），所以汉化版压力还是挺大的。', '网易引进漫威官方漫画app让漫粉很高兴，对比原版本9.99刀美金的会员制来讲，10元会员制对购买力比较低的中国用户很友好，当然9刀之于美国佬和10人民币至于我们来说没差。加上还要有专门团队汉化，运营，工作人员辛苦了💦。下面说说软件现在的缺点。1.人物不全，汉化较慢，估计工作人员也在加班加点的熬，补全', '', 0, 4931, '2020-06-11 14:43:40', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (87, 14, 1, '', NULL, NULL, '目前使用格志日记有几个不成熟小建议：☝️如果能够插入表格什么的就太棒了，有时候想记录一下身高体重的变化，柱状图或者折线图会更加一目了然。✌️如果能自由切换编辑模式就好了。有时候想要在计划上打个勾，但是非得点进去才可以，如果预览界面也可以简易编辑就太棒啦！👌一张纸能分成三个部分就好了，强迫症特别不喜欢分成三格的时候最下面有个空白的格子😂😂😂其他的都超级棒的！希望越做越好！', '目前使用格志日记有几个不成熟小建议：☝️如果能够插入表格什么的就太棒了，有时候想记录一下身高体重的变化，柱状图或者折线图会更加一目了然。✌️如果能自由切换编辑模式就好了。有时候想要在计划上打个勾，但是非得点进去才可以，如果预览界面也可以简易编辑就太棒啦！👌一张纸能分成三个部分就好了，强迫症特别不喜欢', '', 0, 1152, '2020-06-11 14:44:04', '2020-06-26 13:42:33', '2020-06-26 13:42:33');
