INSERT INTO `fb_posts_copy1` VALUES (116, 26, 1, '', NULL, NULL, '#给Tayasui Calligraphy一点小建议\n这个软件笔刷什么的真的超级赞啊，超喜欢，但是在用的过程中还是有点小建议，希望制作组注意一下以前一直是手写的，入了板写坑后感觉绘图软件的笔刷没有预想中的好用。不过这款的笔刷做的真的很棒，有模仿墨水在纸上的痕迹感，沙沙的声音也更有在纸上书写的感觉，我很喜欢。                                                 就是希望功能可以更加完善一下：1、感觉橡皮擦还可以更精准点 2、希望可以添加更多的笔刷 3、最最重要的是一定要有图层功能或者是辅助线功能，这对容易写歪的菜鸡真的很重要！(^з^)-☆', '#给Tayasui Calligraphy一点小建议\n这个软件笔刷什么的真的超级赞啊，超喜欢，但是在用的过程中还是有点小建议，希望制作组注意一下以前一直是手写的，入了板写坑后感觉绘图软件的笔刷没有预想中的好用。不过这款的笔刷做的真的很棒，有模仿墨水在纸上的痕迹感，沙沙的声音也更有在纸上书写的感觉，我', '', 0, 238, '2020-06-15 12:08:19', '2020-06-22 14:58:50', '2020-06-22 14:58:50');
