INSERT INTO `fb_posts_copy1` VALUES (123, 33, 1, '', NULL, NULL, 'Sorted³真的是一款非常好的时间规划软件，用了它之后每天的目标和任务会更加明确，会及时提醒该做哪些事，但还是有点细节上不太满意，希望可以做出更新。 1.提前提醒如果选择为及时提醒，会提醒两次，感觉没有必要。 2.希望可以增加截止日期的功能。 3.希望可以增加给列表备注的功能，这样感觉会更加实用。 4.希望增加标签的功能。如果标签功能能分为主标签和下属的子标签的话，会让原本就很好的标签功能更加实用和一目了然，思路更加清楚。 希望采纳。谢谢。', 'Sorted³真的是一款非常好的时间规划软件，用了它之后每天的目标和任务会更加明确，会及时提醒该做哪些事，但还是有点细节上不太满意，希望可以做出更新。 1.提前提醒如果选择为及时提醒，会提醒两次，感觉没有必要。 2.希望可以增加截止日期的功能。 3.希望可以增加给列表备注的功能，这样感觉会更加实用。', '', 0, 4844, '2020-06-15 15:59:31', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (124, 34, 1, '', NULL, NULL, '作为一个古董级别的老用户，给印象笔记提几点意见。 1.这次更新后，助理那一栏又显示不完了，以前也出现过类似的情况。 2.印象笔记我用了很多年了，期间也付过费，但是都是年费标准或年费高级。最近因为没有活动，也没有续费。 3.印象笔记中国独立出来以后，确实新增了很多有用的功能，这点值得表扬。但是也有几个劣势： a.每一个平台之间的功能差异太大，比如我在公司用的是windows，在家里用的是mac，手机是iOS，但是这几个端的功能，差距很大，导致很不方便。 b.我不喜欢装太多重复功能的APP，但是印象笔记出了这么多新功能，没有一项功能，能让我卸载掉另一款APP。感觉都是半成品。 Markdown，我没能卸载掉topya； 思维导图，我没能卸载掉xmind； 提醒我没能卸载掉滴答清单； 备忘，我没能卸载掉google keep，当然作为谷歌忠实粉，我也不会卸载google keep； 剪切板，我也没能卸载掉pin，如果剪切板能在小部件那里显示几条的话就好了。 4.所以希望印象笔记能细化一下新出的这几个功能，即使现在不出新功能也没有什么。还有导出pdf这个，希望能再优化一下，现在感觉很不方便，而且导出的也很难看。不说全部，就那几个功能当中有2/3可以让我代替掉其他的软件，我绝对是毫不犹豫的开年费专业用户。 5.iOS端设计布局感觉很不方便，必须返回才能看见我的笔记本，挺怪的。最初绿色那版有特色又漂亮；而且如果我用印象笔记作为待办或备忘，那么每次我进入印象笔记都必须返回，然后再进入代办，感觉很麻烦，因为待办和备忘本来就属于轻量型的。而且待办提醒希望能增加阴历！这个很重要！ 写了这么多，纯手打，希望你们能多注重用户的意见，祝你们越做越好。', '作为一个古董级别的老用户，给印象笔记提几点意见。 1.这次更新后，助理那一栏又显示不完了，以前也出现过类似的情况。 2.印象笔记我用了很多年了，期间也付过费，但是都是年费标准或年费高级。最近因为没有活动，也没有续费。 3.印象笔记中国独立出来以后，确实新增了很多有用的功能，这点值得表扬。但是也有几个', '', 0, 4837, '2020-06-15 16:30:39', '2020-07-18 11:37:42', NULL);
