INSERT INTO `fb_posts_copy1` VALUES (141, 48, 1, '', NULL, NULL, '快手短视频打卡都连打3天了，一直都不成功！按照官方说明操作的，客服也咨询过了，后台也没法查，也按照客服说的操作进行了打卡也不成功！看来快手还有许多需要完善的啊！作为开发角度来讲这个打卡程序不是很完善(或许是有bug吧)，但至少不像客服所说那样重启手机和快手就可以解决的，打卡失败应该要显示原因的吧？！后台应该可以有日志可查吧？', '快手短视频打卡都连打3天了，一直都不成功！按照官方说明操作的，客服也咨询过了，后台也没法查，也按照客服说的操作进行了打卡也不成功！看来快手还有许多需要完善的啊！作为开发角度来讲这个打卡程序不是很完善(或许是有bug吧)，但至少不像客服所说那样重启手机和快手就可以解决的，打卡失败应该要显示原因的吧？！', '', 0, 4747, '2020-06-17 16:26:33', '2020-07-18 11:37:42', NULL);
