INSERT INTO `fb_posts_copy1` VALUES (143, 53, 1, '', NULL, NULL, 'paper曾经是ipad里最喜欢的App，最早的时候叫53paper，图标还是圆形的水彩画，那时里面的设计特别棒，配色也让人眼前一样，还可以看到世界各地的爱好画画的人上传的画。因为特别喜欢，还特意买了胡桃木的配套铅笔，又换了可以识别笔的新iPad。后来出的Mix功能也很喜欢，看到很多有趣的创意。可惜后来画册就不是书本翻页式的了，封面也不能自定义，Mix也没了，也不能看别人画的精选作品了，连笔刷都要收费了，胡桃木的蓝牙连接口也没了，形同虚设。付费水准变来变去，让人很失望。作为最早的拥护者，也慢慢转战procreate 了。不是不舍得为你付费，而是你们前后矛盾的方式太让人失望，原来的牵动人心的设置一点一点消失让人痛心！！！', 'paper曾经是ipad里最喜欢的App，最早的时候叫53paper，图标还是圆形的水彩画，那时里面的设计特别棒，配色也让人眼前一样，还可以看到世界各地的爱好画画的人上传的画。因为特别喜欢，还特意买了胡桃木的配套铅笔，又换了可以识别笔的新iPad。后来出的Mix功能也很喜欢，看到很多有趣的创意。可惜', '', 0, 4747, '2020-06-17 16:42:28', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (144, 54, 1, '', NULL, NULL, '目前使用格志日记有几个不成熟小建议：☝️如果能够插入表格什么的就太棒了，有时候想记录一下身高体重的变化，柱状图或者折线图会更加一目了然。✌️如果能自由切换编辑模式就好了。有时候想要在计划上打个勾，但是非得点进去才可以，如果预览界面也可以简易编辑就太棒啦！👌一张纸能分成三个部分就好了，强迫症特别不喜欢分成三格的时候最下面有个空白的格子😂😂😂其他的都超级棒的！希望越做越好！', '目前使用格志日记有几个不成熟小建议：☝️如果能够插入表格什么的就太棒了，有时候想记录一下身高体重的变化，柱状图或者折线图会更加一目了然。✌️如果能自由切换编辑模式就好了。有时候想要在计划上打个勾，但是非得点进去才可以，如果预览界面也可以简易编辑就太棒啦！👌一张纸能分成三个部分就好了，强迫症特别不喜欢', '', 0, 4747, '2020-06-17 16:47:18', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (145, 55, 1, '', NULL, NULL, '随便试了试简衣橱app就决定购买了，毕竟衣服真的是太太太多了。使用过程中有一点点不便： 1，抠图时吸色工具能否把点击改为划动？即划过的颜色都抠掉，一下一下戳得我心烦意乱… 2，抠图中能否有补全工具（与擦除相反）呢？有时候自动抠图刚好多扣掉一点点，强迫症忍不了，只能手动一点一点擦… 3，求自动备份！！录入那么多衣服我怕有一天忘记备份 没了我会哭… 希望得到回复谢谢~', '随便试了试简衣橱app就决定购买了，毕竟衣服真的是太太太多了。使用过程中有一点点不便： 1，抠图时吸色工具能否把点击改为划动？即划过的颜色都抠掉，一下一下戳得我心烦意乱… 2，抠图中能否有补全工具（与擦除相反）呢？有时候自动抠图刚好多扣掉一点点，强迫症忍不了，只能手动一点一点擦… 3，求自动备份！！', '', 0, 4747, '2020-06-17 16:49:32', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (146, 56, 1, '', NULL, NULL, '石墨文档无论是办公还是写文都很好用！但还是有一点点小的建议。 1. 不知能否增加【设置默认字体/字号】的功能？现在的版本里，有时候即便通过”全选“改变字号大小，但是再继续输入的时候又会回到默认的”11“字号。这个用起来有些不方便 2. 不知能否增加【缩放页面】的功能？尤其是ios版中。默认字号有点小，看不清；而改变字号会出现上述bug。辛苦开发人员！！谢谢～希望越做越好', '石墨文档无论是办公还是写文都很好用！但还是有一点点小的建议。 1. 不知能否增加【设置默认字体/字号】的功能？现在的版本里，有时候即便通过”全选“改变字号大小，但是再继续输入的时候又会回到默认的”11“字号。这个用起来有些不方便 2. 不知能否增加【缩放页面】的功能？尤其是ios版中。默认字号有点小', '', 0, 4741, '2020-06-19 13:33:06', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (147, 58, 1, '', NULL, NULL, '感谢潮汐开发者，软件和音乐很棒，使我在快节奏的生活里可以轻松缓解疲惫，工作上更容易专注。 小建议： 希望不同模式下可以锁定不同的音乐。早上起来冥想喜欢听的音乐和睡前的音乐不同，每次都要手动切换不是很方便。望采纳。希望软件越来越好，么么哒～', '感谢潮汐开发者，软件和音乐很棒，使我在快节奏的生活里可以轻松缓解疲惫，工作上更容易专注。 小建议： 希望不同模式下可以锁定不同的音乐。早上起来冥想喜欢听的音乐和睡前的音乐不同，每次都要手动切换不是很方便。望采纳。希望软件越来越好，么么哒～', '', 0, 4741, '2020-06-19 13:44:45', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (148, 59, 1, '', NULL, NULL, '青璃场景精致唯美、格斗打击带感，配音也很赞，滤镜在拍照功能里，确实沉浸其中，可以当电影看。 但，①反派角色服装太现代 我很出戏，②在船上劈开锁找妹子时 居然踹开门，要是妹子在门后…③卡在雪山 掉下桥机关那里，要先卡箱子，跳上平台再拉妹子！！（为什么这么麻烦呀 囧）④最后男生哼唱的曲子让我出戏，感觉破坏了气氛。⑤马奔跑的时候扬起灰尘会更真实。', '青璃场景精致唯美、格斗打击带感，配音也很赞，滤镜在拍照功能里，确实沉浸其中，可以当电影看。 但，①反派角色服装太现代 我很出戏，②在船上劈开锁找妹子时 居然踹开门，要是妹子在门后…③卡在雪山 掉下桥机关那里，要先卡箱子，跳上平台再拉妹子！！（为什么这么麻烦呀 囧）④最后男生哼唱的曲子让我出戏，感觉破', '', 0, 4739, '2020-06-19 13:51:26', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (149, 49, 1, '', NULL, NULL, '给滴墨app提个建议： 一是希望能增添目录功能，这样整合笔记更容易查找，尤其是学术类书籍。或者是可以添加标题，这样也能迅速查找书摘所属的章节，比如短篇小说集就可以直接找到那一篇的名字了 二是希望把“页码”扩展到“页码或进度”，因为电子书的页码是不固定的，所以无法根据页码查找，希望滴墨开发者能看到！！！', '给滴墨app提个建议： 一是希望能增添目录功能，这样整合笔记更容易查找，尤其是学术类书籍。或者是可以添加标题，这样也能迅速查找书摘所属的章节，比如短篇小说集就可以直接找到那一篇的名字了 二是希望把“页码”扩展到“页码或进度”，因为电子书的页码是不固定的，所以无法根据页码查找，希望滴墨开发者能看到！！', '', 0, 4737, '2020-06-19 14:08:46', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (150, 60, 1, '', NULL, NULL, '用了晒书房一下午的时间，整理了800多册图书📚使用下来的具体感受，最显著的支持多本图书连续扫一扫的功能。 ❤️❤️❤️具体感动我的几个优点😍： 1⃣️扫一扫ISBN码就能把图书信息全部录入，录入速度非常快捷； 还可以多本书连续扫，比一个个拿起来扫描快多了；如果重复录入也会自动提醒； 2⃣️可以自动为图书进行分类，还支持自建标签分类，方便分类和整理； 3⃣️可以导出并邮寄书单到个人的邮箱； 不过目前只有pdf的富文本格式，希望能够支持简单的excel或文本清单格式； 4⃣️查阅书目方便： 导入后可以通过名字或关键字搜索自己的同类书籍； ❤️几点小小的改进意见，希望有机会被斟酌和采纳： 1⃣️增加排序功能：比如根据标签类别排序，录入时间排序，书名排序，出版时间排序等等； 2⃣️增加自定义图书功能： 本人有些国外采购的外文数目, 无法录入； 3⃣️增加阅读视图：大图的浏览书目的窗口，一眼只能看到3～6本图书，对数目总数多多人来说，浏览效率不高； 4⃣️增加思维导图等内容整理，以及推荐什么类型的人阅读等功能，增加有权限等级分类下的内容分享功能； 喜欢这种坚持帮爱书之人收纳整理的App，愿意为以上意见及从此App中获得的帮助成为付费用户。感谢晒书房开发团队的努力～', '用了晒书房一下午的时间，整理了800多册图书📚使用下来的具体感受，最显著的支持多本图书连续扫一扫的功能。 ❤️❤️❤️具体感动我的几个优点😍： 1⃣️扫一扫ISBN码就能把图书信息全部录入，录入速度非常快捷； 还可以多本书连续扫，比一个个拿起来扫描快多了；如果重复录入也会自动提醒； 2⃣️可以自动为', '', 0, 4736, '2020-06-19 16:42:06', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (151, 61, 1, '', NULL, NULL, '滴答清单是很好上手的规划类应用，功能也齐全，整合到一个应用里，方便使用。提两点使用过程中感觉可以改进的地方： 一是过期日程，过期日程在第二天会和当天任务混淆，还要手动更新，希望能有个分类，先显示当天，再显示昨日未完成 二是希望能在番茄时钟的页面直接手动滚动选择番茄钟的时长，因为做不同工作时需要专注的时长不一样，每次都要点右上角去修改不太方便 三是不连接耳机直接播放白噪音时手机会过热，不知道这是否是普遍性问题，期待越来越好！', '滴答清单是很好上手的规划类应用，功能也齐全，整合到一个应用里，方便使用。提两点使用过程中感觉可以改进的地方： 一是过期日程，过期日程在第二天会和当天任务混淆，还要手动更新，希望能有个分类，先显示当天，再显示昨日未完成 二是希望能在番茄时钟的页面直接手动滚动选择番茄钟的时长，因为做不同工作时需要专注的', '', 0, 4736, '2020-06-19 16:44:37', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (152, 62, 1, '', NULL, NULL, '使用豆瓣过程中遇到过这些问题：1.看划线和批注时，若去参考原文再返回批注，就需要再次找批注位置，很麻烦，阅读效率很低。当批注较多，需要参考原文时，非常痛苦。2.搜索图书，没有分类检索，要想根据一个关键词去找一本书，非常困难。3.已购图书，不能分类管理。若购买图书较多，管理很麻烦。 4.划线没有颜色分类，复读、回顾很麻烦。以上，豆瓣作为“专业”读书的平台，这样的设计思路不及格。 5.无法搜索内文和批注，这一点希望改善！', '使用豆瓣过程中遇到过这些问题：1.看划线和批注时，若去参考原文再返回批注，就需要再次找批注位置，很麻烦，阅读效率很低。当批注较多，需要参考原文时，非常痛苦。2.搜索图书，没有分类检索，要想根据一个关键词去找一本书，非常困难。3.已购图书，不能分类管理。若购买图书较多，管理很麻烦。 4.划线没有颜色分', '', 0, 4735, '2020-06-19 16:46:30', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (153, 63, 1, '', NULL, NULL, '用了看理想一段时间，内容不是海量，但实属精品，这样挺好的，比良莠不齐一大堆内容的那种app好多了，软件做的也精致简洁。老友会员已买，节目也买了有二十个了，是每天陪伴我最多的软件之一。 盼望有更多棒棒的原创节目上线哈！比如关于茶文化的节目、关于奢侈品的节目、关于珠宝的节目、自然科学科普类的节目、讲动植物的节目、路内、阿乙、格非等等作家有声书的节目、关于世界各地传统民俗的节目、旅游目的地类的节目、当代流行文化的节目，村上春树的有声书可以安排一下，故事便利店也可以再来几季……很多很多都期待能在看理想听到～', '用了看理想一段时间，内容不是海量，但实属精品，这样挺好的，比良莠不齐一大堆内容的那种app好多了，软件做的也精致简洁。老友会员已买，节目也买了有二十个了，是每天陪伴我最多的软件之一。 盼望有更多棒棒的原创节目上线哈！比如关于茶文化的节目、关于奢侈品的节目、关于珠宝的节目、自然科学科普类的节目、讲动植', '', 0, 4735, '2020-06-19 16:48:35', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (154, 64, 1, '', NULL, NULL, '用了熊掌记大概几个礼拜，📝记录了一些学习的笔记。又一个小问题，就是记笔记会插入图片，但是翻笔记的时候看到的图片是糊的，只有点开了才是上传时清晰的原图。有的时候只是空下来翻翻笔记，所以说点开来再复习可能有点麻烦，希望能改善呀。总之很不错了，希望可以一直免费👀', '用了熊掌记大概几个礼拜，📝记录了一些学习的笔记。又一个小问题，就是记笔记会插入图片，但是翻笔记的时候看到的图片是糊的，只有点开了才是上传时清晰的原图。有的时候只是空下来翻翻笔记，所以说点开来再复习可能有点麻烦，希望能改善呀。总之很不错了，希望可以一直免费👀', '', 0, 4734, '2020-06-19 16:50:23', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (155, 65, 1, '', NULL, NULL, '记账城市相当不错，让人有记账的兴趣和坚持的动力。此处有几个建议： 1、能否把里面的“财务长计画”“有计画地投资自己”等等的“画”字改成“划”？毕竟“计画”在现代汉语中不常见，看着还别扭 2、看广告时手机发热量严重，亟待优化 3、建议增加资产总额，即各个月份损益的累加 4、随着城市规模不断扩大，小任务找东西越来越难，钻石奖励理应相应递增，希望记账城市越来越好！', '记账城市相当不错，让人有记账的兴趣和坚持的动力。此处有几个建议： 1、能否把里面的“财务长计画”“有计画地投资自己”等等的“画”字改成“划”？毕竟“计画”在现代汉语中不常见，看着还别扭 2、看广告时手机发热量严重，亟待优化 3、建议增加资产总额，即各个月份损益的累加 4、随着城市规模不断扩大，小任务', '', 0, 4733, '2020-06-19 16:52:08', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (156, 66, 1, '', NULL, NULL, '先支持一下 note笔记～\n同步做的很好呀 在手机上做的改动 ipad一下就变了 \n界面很棒 卡片清晰有特色 简直是我摘抄和记录idea 记录看展这些小事儿们的绝佳助手 \n几个小建议:\n1、可以考虑例如地理位置/地图标示 音乐 等插入\n2、ipad版是否可以加入一个模式 比如可以全屏显示所有卡片/文件夹（比如向左右拉动界面切换，而不是永远只能在小小的一侧  \n3、提供备注功能 特别是对于文件夹 轻点hold住的时候可以出现备注框 可以备注时间地点或其他信息？ \n4、排序可变 除了置顶之外 可否可以自己选择开启 可调整卡片顺序的模式  \n5、灵感排序 就是点一次之后随机打乱 比如我有很多文件夹用于摘抄或记录idea（我觉得noto很适合做这些事）我不希望永远只能看到上部分的内容比较多 \n6、全图片笔记 也就是一个card实际上就是一张图 会比直接一个card里面插一张图看上去更好（就是等于card是存粹的一张图片？不知道意思有没有表达清楚） \n7、进入书写的时候主标题显示有点太大了 特别是对于手机来说 稍微小一点可能更好 暂时想到这些 好像你们是十月份才上的 真的挺好的 就是完整版有些贵 特别是像图片这样的基础功能或许开放成免费的说不定能吸引更多人尝试下去 \n希望你们能越做好！！！', '先支持一下 note笔记～\n同步做的很好呀 在手机上做的改动 ipad一下就变了 \n界面很棒 卡片清晰有特色 简直是我摘抄和记录idea 记录看展这些小事儿们的绝佳助手 \n几个小建议:\n1、可以考虑例如地理位置/地图标示 音乐 等插入\n2、ipad版是否可以加入一个模式 比如可以全屏显示所有卡片/文', '', 0, 101, '2020-06-19 16:55:51', '2020-06-22 14:17:50', '2020-06-22 14:17:50');
