INSERT INTO `fb_posts_copy1` VALUES (185, 86, 1, '', NULL, NULL, '藏书馆真的是一个看书的宝藏app，不功利。我个人觉得可以：1.资源希望更充足，有些书还是没有资源 2.其实可以试着开拓一下二手书市场，这样既可以看电子版，又可以买到自己喜欢的纸质书！ 望采纳🌹', '藏书馆真的是一个看书的宝藏app，不功利。我个人觉得可以：1.资源希望更充足，有些书还是没有资源 2.其实可以试着开拓一下二手书市场，这样既可以看电子版，又可以买到自己喜欢的纸质书！ 望采纳🌹', '', 0, 4546, '2020-06-22 20:40:03', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (186, 87, 1, '', NULL, NULL, '经朋友推荐下载了这个多抓鱼，我俩同为搬家和没钱的痛苦所折磨，收书的功能非常方便好用。使用一段时间后，发现app上还经常能找到市面上绝迹的书，越来越喜欢。想提建议是，家中购有不少艺术 设计类书籍，如画册、设计理论、设计合集期刊、绘本等，有近一半是被拒收的，不知以后能否能进一步优化和扩大收书范围呢？', '经朋友推荐下载了这个多抓鱼，我俩同为搬家和没钱的痛苦所折磨，收书的功能非常方便好用。使用一段时间后，发现app上还经常能找到市面上绝迹的书，越来越喜欢。想提建议是，家中购有不少艺术 设计类书籍，如画册、设计理论、设计合集期刊、绘本等，有近一半是被拒收的，不知以后能否能进一步优化和扩大收书范围呢？', '', 0, 4546, '2020-06-22 20:41:24', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (187, 88, 1, '', NULL, NULL, '致HRZN开发者：很喜欢这个app，也购买了所有滤镜，但是我发现了一个严重的问题，就是拍摄照片有摩尔纹，很明显的摩尔纹。CR400在阳光下拍摄出现的，但并不是逆光，其他的目前没有测试和发现。希望能在下一个版本改进。', '致HRZN开发者：很喜欢这个app，也购买了所有滤镜，但是我发现了一个严重的问题，就是拍摄照片有摩尔纹，很明显的摩尔纹。CR400在阳光下拍摄出现的，但并不是逆光，其他的目前没有测试和发现。希望能在下一个版本改进。', '', 0, 4546, '2020-06-22 20:42:58', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (188, 89, 1, '', NULL, NULL, '首先对于不思议迷宫这款游戏我给9分，可以说是我近2年来玩过最好的手机游戏.好的我就不说了，玩过了都知道，只说几个不足。这游戏离不开百度.....碰到彩蛋太多还有冈布奥搭配等等上必须去百度解决。希望多点游戏内的推荐攻略什么的。还有就是对新手来说不是很友好。所有东西都需要自己去挖掘. 这点也可以说是优点。但是缺乏玩家互动挖掘肯定要大家一起来挖掘才有意思啊！最喜欢的一点是每个怪物都可以评论，可以看看其他玩家是怎么评论的或者有没有攻略。推荐加入频道聊天系统比如现在ABC等人都在某某副本。我作为其中任意一人都可以在这个频道上打字发言而且任何的发言也可以一直保留并不是完了就完了。这样有及时性的感觉一些同时也能查找到自己的发言记录能有回忆感.也可以增加多人模式冒险比如空战现在是自动。多人能手动选择目标这样肯定更火。望采纳！', '首先对于不思议迷宫这款游戏我给9分，可以说是我近2年来玩过最好的手机游戏.好的我就不说了，玩过了都知道，只说几个不足。这游戏离不开百度.....碰到彩蛋太多还有冈布奥搭配等等上必须去百度解决。希望多点游戏内的推荐攻略什么的。还有就是对新手来说不是很友好。所有东西都需要自己去挖掘. 这点也可以说是优点', '', 0, 4544, '2020-06-22 20:45:25', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (189, 90, 1, '', NULL, NULL, '#Agenda开发者看过来\n提一下建议和疑问： 1求中文 2我是拿app记笔记的，希望有在打字中快速插入时间的功能 类似bear。 3不清楚能不能锁定记好的内容不被误修改 4层级太少 不适合分类记录的东西 5并不喜欢用日历这个软件 因为不是想用它弄工作提醒 ，而是用来做时间记录 ，比如哪个时刻我做了什么 。因此日历插入的时间非要手动选择 很麻烦 一年前的日历内容更是无法搜索，所以希望Agenda能独立有自己的时间线编辑。', '#Agenda开发者看过来\n提一下建议和疑问： 1求中文 2我是拿app记笔记的，希望有在打字中快速插入时间的功能 类似bear。 3不清楚能不能锁定记好的内容不被误修改 4层级太少 不适合分类记录的东西 5并不喜欢用日历这个软件 因为不是想用它弄工作提醒 ，而是用来做时间记录 ，比如哪个时刻我做了', '', 0, 4543, '2020-06-22 20:49:36', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (190, 91, 1, '', NULL, NULL, '我从初中到现在用的都是小猿搜题 这款软件真的对学习特别有用 归纳整理知识点、专业老师视频讲解、学习专区可供自主预习 这款软件真的特别棒 但是唯一的问题就是感觉还没有完全适配iPad 因为没办法横屏！！！😂每次写作业想搜题了还得把iPad转一下，着实很麻烦。望开发者采纳我的建议！🤩', '我从初中到现在用的都是小猿搜题 这款软件真的对学习特别有用 归纳整理知识点、专业老师视频讲解、学习专区可供自主预习 这款软件真的特别棒 但是唯一的问题就是感觉还没有完全适配iPad 因为没办法横屏！！！😂每次写作业想搜题了还得把iPad转一下，着实很麻烦。望开发者采纳我的建议！🤩', '', 0, 4543, '2020-06-22 20:51:31', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (191, 92, 1, '', NULL, NULL, '我想知道有没有人和我一样，yongfoodie拍完照片就闪退，照片什么都没留下，更新了，也卸载重新下载了还是一样，用了好多年的软件竟然出现这种问题，哭了😭', '我想知道有没有人和我一样，yongfoodie拍完照片就闪退，照片什么都没留下，更新了，也卸载重新下载了还是一样，用了好多年的软件竟然出现这种问题，哭了😭', '', 0, 4543, '2020-06-22 21:19:15', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (192, 93, 1, '', NULL, NULL, '宝宝生活记录对于我这种强迫症妈妈来说非常好的一款app，可以记录宝宝的日常生活。 美中不足的是，闹钟提醒功能用处不大，因为宝宝不可能完全按照设定的时间来吃奶换尿布，一旦没有按时完成，后面的每次提醒就无意义。如果可以把闹钟功能增加一个选项是可以设定为上一次事件后x小时后提醒就完美了。', '宝宝生活记录对于我这种强迫症妈妈来说非常好的一款app，可以记录宝宝的日常生活。 美中不足的是，闹钟提醒功能用处不大，因为宝宝不可能完全按照设定的时间来吃奶换尿布，一旦没有按时完成，后面的每次提醒就无意义。如果可以把闹钟功能增加一个选项是可以设定为上一次事件后x小时后提醒就完美了。', '', 0, 4543, '2020-06-22 21:24:21', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (193, 94, 1, '', NULL, NULL, '希望CNKI在资料库栏里可以删除本地文件但保留记录，有需要再下载，iPad空间小，文献一多删了有指不定要用，到时还不记得文章名。另外，收藏希望可以分类收藏，久了会很乱了。', '希望CNKI在资料库栏里可以删除本地文件但保留记录，有需要再下载，iPad空间小，文献一多删了有指不定要用，到时还不记得文章名。另外，收藏希望可以分类收藏，久了会很乱了。', '', 0, 4543, '2020-06-22 21:26:24', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (194, 95, 1, '', NULL, NULL, '彩云小译有多好，翻译的有多么智能，大家有目共睹，真的是非常好的软件，必须要夸。接下来说不足，1、在翻译页面为什么会存在文章的推送呢，我有时候不小心下拉一下就会出现一篇阅读，我是来翻译的，暂且不需要阅读，现在给我推送文章，只会拖慢我的进度并且使我反感，因为文章推送这一点，我好几次都想卸载软件，我看评论区也有人提，希望开发者能看到我们的建议，谢谢。 2、我的手机和ipad上都下载了这个软件，但是我看彩云小译在我的iPad上没办法随着屏幕的旋转而旋转，我有时候翻译句子的时候，内容在iPad上，因为iPad打字修改比较方便，但是iPad上软件无法旋转，我就得手机iPad两边倒，希望开发者可以改进一下，或者大家有没有什么好的办法可以分享一下的，谢谢了。', '彩云小译有多好，翻译的有多么智能，大家有目共睹，真的是非常好的软件，必须要夸。接下来说不足，1、在翻译页面为什么会存在文章的推送呢，我有时候不小心下拉一下就会出现一篇阅读，我是来翻译的，暂且不需要阅读，现在给我推送文章，只会拖慢我的进度并且使我反感，因为文章推送这一点，我好几次都想卸载软件，我看评论', '', 0, 4542, '2020-06-22 21:28:47', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (195, 96, 1, '', NULL, NULL, '希望Timi可以在搜索那里新增账目统计的功能，比如搜索“苹果”，可以统计我在水果类别下搜索到的关于相同备注的“苹果”数量统计、支出统计等。', '希望Timi可以在搜索那里新增账目统计的功能，比如搜索“苹果”，可以统计我在水果类别下搜索到的关于相同备注的“苹果”数量统计、支出统计等。', '', 0, 4542, '2020-06-22 21:30:07', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (196, 97, 1, '', NULL, NULL, '#LinkedIn bugs to report\nWhen searching for people, the filter “location” is only available for locations within China. For example, if I type United Kingdom or Unites States, they won’t appear. -When searching for people, it doesn’t appear how many results are out there. For example, if I search in English version, “Bill Gates”, in the upper left corner will give me “45,542 results”, so I can know how to best get my wanted result. Thank you and hope these problems would be fixed for next release.', '#LinkedIn bugs to report\nWhen searching for people, the filter “location” is only available for locations within China. For example, if I type United ', '', 0, 4542, '2020-06-22 21:32:18', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (197, 99, 1, '', NULL, NULL, '‼️希望SleepTown能改进小圈圈就寝起床时间要一致的规则。每个人都有自己的作息规律，没必要大家都规定成同样的，我认为小圈圈的意义就在于能让大家体会到有别人也在一起和我朝着他的目标努力，类似线上自习室那样，要的是这样一种氛围和鼓励。 若硬性要求大家都规定成一样的时间，反而失去了用这个软件的本意，因为许多人会为了睡觉而睡觉——收集各式房子、奇观。就像我，很想加入一个小圈圈但周围没有朋友在用，我只能加入一个网上得知的，但它的时间与我不符，我只能自己另外规定就寝、起床，这和我原本下这个app的意图完全不一样！若长此以往，这个app迟早会变成一个休闲收集小游戏，让我不想再用它！', '‼️希望SleepTown能改进小圈圈就寝起床时间要一致的规则。每个人都有自己的作息规律，没必要大家都规定成同样的，我认为小圈圈的意义就在于能让大家体会到有别人也在一起和我朝着他的目标努力，类似线上自习室那样，要的是这样一种氛围和鼓励。 若硬性要求大家都规定成一样的时间，反而失去了用这个软件的本意，', '', 0, 4339, '2020-06-23 10:01:02', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (198, 100, 1, '', NULL, NULL, '算是小睡眠的深度用户了，但是觉得积分奖励的设置真的很拉低好感度。 1.每日签到： 很多app的签到系统都为打开并使用app便自动签到，或将签到设置为弹窗、签到按键设置在显眼处。小睡眠里的签到按键设置得太容易让人忽略，建议更改为自动签到。对于大部分用户来说，小睡眠的使命是助眠，更简便的设置才更符合实际需求。 2.播放音频的积分奖励：从个人使用情况来看，专业助眠里的音频是不计入这个30min的时长的，而大部分「专业助眠」里的音频都是需要付费/VIP权限的。不计入专业助眠的设定真的合理吗？这是在劝退付费用户吗？可以将这个设定理解为引导免费音频的播放吗？ 综上，作为付费会员，在积分中心里没有看到丝毫的诚意。如果保留这类的设定，于我个人而言，应该是不会再考虑充值会员了。', '算是小睡眠的深度用户了，但是觉得积分奖励的设置真的很拉低好感度。 1.每日签到： 很多app的签到系统都为打开并使用app便自动签到，或将签到设置为弹窗、签到按键设置在显眼处。小睡眠里的签到按键设置得太容易让人忽略，建议更改为自动签到。对于大部分用户来说，小睡眠的使命是助眠，更简便的设置才更符合实际', '', 0, 4290, '2020-06-23 10:18:52', '2020-07-18 11:37:42', NULL);
