INSERT INTO `fb_posts_copy1` VALUES (201, 101, 1, '', NULL, NULL, '首先我觉得概念画板真的是很棒的。最初看上这款软件也是应为里面的调色盘，和开发商的认真负责的态度，不过还是有几点小建议想要提出来1、软件使用过程中的美中不足就是对于“填充”的使用，我不知道是我没研究透还是什么，希望到时候能够出现那种在一个封闭图形中点一下就能上色的倒色桶 2、增加调色盘。调色盘可以适当补充一些颜色 3、对于水彩笔的使用。建议添加提个类似水彩笔的画笔，原配的水彩笔晕染的太厉害，即使粗细调小了。 4、橡皮的不足。只款软件第二个可以改进的地方就是橡皮。如果我用硬角遮盖的话希望能够擦的圆滑一点，比如，我画两条几乎重叠的线条，用硬角遮盖一擦，基本上做不到擦的很干净、圆润，也就是说一般如果想擦半根线条是不可能的（可以自己试一下）你若想擦半根线一般一整根线都会被擦掉（这一部分可能表达不清楚） 5、不同的橡皮。在橡皮这方面我认为还可以添加一个“完整橡皮”就是例如画了一个圆，你只要用这个这个圆弧上的在任意地方点一下就可以将整个圆擦掉，这个功能在很多别的画图软件里都有，总而言之就是一次擦一笔。 以上是我个人使用这个软件时发现的一些可以改进的地方，我不清楚若需改进这些方面的难度有多大毕竟我不是专业人士。总的来说，还是很棒的！', '首先我觉得概念画板真的是很棒的。最初看上这款软件也是应为里面的调色盘，和开发商的认真负责的态度，不过还是有几点小建议想要提出来1、软件使用过程中的美中不足就是对于“填充”的使用，我不知道是我没研究透还是什么，希望到时候能够出现那种在一个封闭图形中点一下就能上色的倒色桶 2、增加调色盘。调色盘可以适当', '', 0, 4262, '2020-06-23 10:26:02', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (202, 102, 1, '', NULL, NULL, '#给梦间集天鹅座的建议\n开始玩的时候，咖啡厅是个很吸引人的部分，有了一种经营类游戏的感觉，让人欲罢不能；剧情的话说来惭愧，我是快进过得，就是为了达成成就，不好评价；每期活动什么的奖励还是很客观的，达成难度也不高；最重要的集卡，不知道是我运气好还是真的掉率挺高，没氪金也能拥有不少ssr，特别是活动的，单抽居然也能出，开心(∩ᵒ̴̶̷̤⌔ᵒ̴̶̷̤∩) 下面来说说瑕疵部分，首先的话，声优方面确实有待加强，声音有些浮于表面，让人带入不了；其次就是遇到天花板了，目前所有人的剧情都过了，咖啡厅也满级，如果不是有活动，每天的话只能单调的做做餐点，偶尔抽卡，继续下去的激情不是很高 其他就是一些优化，例如猫爪小铺购买增加数量选择；外卖增加一键外卖，实现满足条件的订单全部清算；一些过场动画实现单击或者可跳过选择，增加舒适感。', '#给梦间集天鹅座的建议\n开始玩的时候，咖啡厅是个很吸引人的部分，有了一种经营类游戏的感觉，让人欲罢不能；剧情的话说来惭愧，我是快进过得，就是为了达成成就，不好评价；每期活动什么的奖励还是很客观的，达成难度也不高；最重要的集卡，不知道是我运气好还是真的掉率挺高，没氪金也能拥有不少ssr，特别是活动的，', '', 0, 4232, '2020-06-23 10:34:25', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (203, 103, 1, '', NULL, NULL, '希望岛读可以增加收藏好句的功能！ 长按这句话的时候会出现收藏，然后在我的里面添加这个收藏的入口，点进去后可以看到自己收藏过的句子列表。甚至还可以导出pdf之类的文档，就更棒了！不知道会不会涉及版权问题？我很乐意为这个功能付费。希望开发者继续努力，越做越好！', '希望岛读可以增加收藏好句的功能！ 长按这句话的时候会出现收藏，然后在我的里面添加这个收藏的入口，点进去后可以看到自己收藏过的句子列表。甚至还可以导出pdf之类的文档，就更棒了！不知道会不会涉及版权问题？我很乐意为这个功能付费。希望开发者继续努力，越做越好！', '', 0, 4231, '2020-06-23 10:36:17', '2020-07-18 11:37:42', NULL);
