INSERT INTO `fb_posts_copy1` VALUES (206, 105, 1, '', NULL, NULL, '每日故宫让我一个00后都喜欢上古董了，尤其笔记也很好看，但是还是有以下几点瑕疵： 1.当初下这个软件就是奔着文物介绍来的，想涨点姿势，结果很可惜，居然没有，偶尔有的那么几个还是特定活动时几少部分才有。扣分。 2.画面占比太大，不能看清楚文物。布局占屏太满，感觉好像把脸贴在文物上一样，眼镜感官很不舒服，尤其放大后画质也模糊了。 你可以放大，别让客户来缩小啊！扣分！ 综合上述两点，建议做出改进： 1.每个文物都配介绍，百度上也有，虽然费功夫， 但体验更好，下载人也多。 2.介于此，建议设计搜索模板，不用上百度，比如我想查四羊方尊，你这里可以直接搜索到。这个功能出来的话，这个APP付费我也想要了。当然要不要跟进扫描识别文物的技术是你们的事情。 3.文物在日历时可以放大，很有美感，但日历点开后就把文物图像缩回去、放在正中间好了，背景或宣纸或茶渍，如果需要进一步查看，点一下，这才放大，随之对这个文物介绍的选项就跟进。 打了半小时字，希望能被开发者采纳！', '每日故宫让我一个00后都喜欢上古董了，尤其笔记也很好看，但是还是有以下几点瑕疵： 1.当初下这个软件就是奔着文物介绍来的，想涨点姿势，结果很可惜，居然没有，偶尔有的那么几个还是特定活动时几少部分才有。扣分。 2.画面占比太大，不能看清楚文物。布局占屏太满，感觉好像把脸贴在文物上一样，眼镜感官很不舒服', '', 0, 4229, '2020-06-23 10:45:45', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (207, 104, 1, '', NULL, NULL, '美团外卖一个月会员15块钱，6张券，这谁够用？？券不够了还得买加量包，加量包又一点儿都不划算。我寻思着吃个饭还得带个小🧮呗？就不能真正搞点儿让用户得到真正实惠的操作？', '美团外卖一个月会员15块钱，6张券，这谁够用？？券不够了还得买加量包，加量包又一点儿都不划算。我寻思着吃个饭还得带个小🧮呗？就不能真正搞点儿让用户得到真正实惠的操作？', '', 0, 4218, '2020-06-23 10:51:06', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (208, 106, 1, '', NULL, NULL, '#VUE Vlog需要改进的地方\n1.人机界面设计的不是很好，新用户可能一下子摸不着头脑，例如导入素材，要进入拍摄后才能看到，还有保存草稿的界面，如果不摸索根本不知道有这功能，不能一次编辑完成，下次要重新做一遍，我是重复做了不知道多少次，别人告诉我有草稿的功能 .2.能否能加入多轨或多画面的功能，3.能否有简单的抠像功能 4.做一个简单的教学片实例，从导入素材，分段，调整，测试，保存，完成，再调整完善，成片', '#VUE Vlog需要改进的地方\n1.人机界面设计的不是很好，新用户可能一下子摸不着头脑，例如导入素材，要进入拍摄后才能看到，还有保存草稿的界面，如果不摸索根本不知道有这功能，不能一次编辑完成，下次要重新做一遍，我是重复做了不知道多少次，别人告诉我有草稿的功能 .2.能否能加入多轨或多画面的功能，3', '', 0, 4215, '2020-06-23 10:53:31', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (209, 107, 1, '', NULL, NULL, '用过很多背单词应用，最终选择了百词斩，百词斩真的好用，比其他应用干净的多，细节也做的很好~ 但是我想提一个建议：就是你们家的那个“开屏单词海报是真的好看”（点赞）就是能不能加一个：就是把今天单词任务完成后，把“开屏单词海报”作为奖励，而可以用户下载开屏单词海报，但是下载的单词海报如果能去掉海报上的“箭头”就很棒了，我是感觉保留海报中的单词是挺好的，单词结合起图片很美，百词斩的水印本就比较小，保留也很不错，不过要是能取消那个“百词斩”水印也是很棒的（超级棒），望采纳，祝百词斩越来越好~', '用过很多背单词应用，最终选择了百词斩，百词斩真的好用，比其他应用干净的多，细节也做的很好~ 但是我想提一个建议：就是你们家的那个“开屏单词海报是真的好看”（点赞）就是能不能加一个：就是把今天单词任务完成后，把“开屏单词海报”作为奖励，而可以用户下载开屏单词海报，但是下载的单词海报如果能去掉海报上的“', '', 0, 4179, '2020-06-23 11:01:49', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (210, 108, 1, '', NULL, NULL, '#FlipaClip产品建议\n1、希望添加油漆桶参考，当线稿和上色不在一个图层时，能按照 线稿来填色（现在不行，有点难受） 2、铅笔的颜色太淡了，使劲画也画不深。 3、希望能选择在播放时跳过某些帧，这样能比较前后效果，挑选出更好的帧数。', '#FlipaClip产品建议\n1、希望添加油漆桶参考，当线稿和上色不在一个图层时，能按照 线稿来填色（现在不行，有点难受） 2、铅笔的颜色太淡了，使劲画也画不深。 3、希望能选择在播放时跳过某些帧，这样能比较前后效果，挑选出更好的帧数。', '', 0, 11, '2020-06-23 11:07:56', '2020-06-23 11:12:24', '2020-06-23 11:12:24');
