INSERT INTO `fb_posts_copy1` VALUES (215, 111, 1, '', NULL, NULL, '使用熊掌记已经有近两年时间，因为工作需要长时间处理文档，有几个建议：1，导出文档时一样可以自定义文档格式，有时需要发送给同事，但是默认的导出文档无法调节。2，全屏大小时无法调节字符宽度，一样可以加入自定义选项。3，增加文稿内查找功能，有时候在一篇长稿件寻找特定的内容实在是困难。', '使用熊掌记已经有近两年时间，因为工作需要长时间处理文档，有几个建议：1，导出文档时一样可以自定义文档格式，有时需要发送给同事，但是默认的导出文档无法调节。2，全屏大小时无法调节字符宽度，一样可以加入自定义选项。3，增加文稿内查找功能，有时候在一篇长稿件寻找特定的内容实在是困难。', '', 0, 4099, '2020-06-23 11:25:12', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (216, 33, 1, '', NULL, NULL, '夹去之间出来挨打，我明明关闭了微博上的周围朋友通过通讯录和邮箱找到我的功能，为什么我朋友还是找到了我？这怎么保障我的隐私？还有我不想在个人资料显示出年龄，还一定要填写生日，填了生日就一定显示出来年龄，无语了！', '夹去之间出来挨打，我明明关闭了微博上的周围朋友通过通讯录和邮箱找到我的功能，为什么我朋友还是找到了我？这怎么保障我的隐私？还有我不想在个人资料显示出年龄，还一定要填写生日，填了生日就一定显示出来年龄，无语了！', '', 0, 4099, '2020-06-23 11:27:55', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (217, 112, 1, '', NULL, NULL, '这几年几乎所有的记录类app都试过了，用了几年的bookly，因为喜欢它的数据统计和简洁的界面风格。但最近又回到了几年前体验过的【阅读记录】，理由是：更新后的功能更强大了，使用感特别贴合个人使用动线。界面也简洁了不少，数据分析一目了然，直观了解个人阅读习惯与阅读记录。而且搜书体验很满意（让我离开bookly主要原因就是搜书太差，大部分都要手动输入书籍信息），尤其是区分电子书和纸质书的功能，以及断点记录，都让我爱不释手。 要说不足的，就是缺少计时时的背景白噪音吧，每次要自己强加音乐软件的自然音（手机耗电）。个人多年的习惯思考：白噪音（自然背景音乐）可以让人更专注于阅读，打开音乐，打开记录软件，于我，便是一种仪式感。 期待有天能盼到【阅读记录】让界面更清澈的前景下，多一个音乐之声。图标与书架页可以再有设计感些（颜值派😅）。', '这几年几乎所有的记录类app都试过了，用了几年的bookly，因为喜欢它的数据统计和简洁的界面风格。但最近又回到了几年前体验过的【阅读记录】，理由是：更新后的功能更强大了，使用感特别贴合个人使用动线。界面也简洁了不少，数据分析一目了然，直观了解个人阅读习惯与阅读记录。而且搜书体验很满意（让我离开bo', '', 0, 4078, '2020-06-23 11:36:41', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (218, 114, 1, '', NULL, NULL, '#给印象笔记一些建议\n1.顶部的搜索框能否设置为可以自动选择搜索内容，比如搜索note还是搜索notebook；在notebook列表很多的时候搜索框只能搜notes还是有些鸡肋。 2.图片转文字的ocr功能能否设计为选择只保存文字，每次拍了照还有再多一步才能生成文字，然后插入后还要自己删除图片，实在是繁复。 3.mindnote的功能希望能更重视，比如可以插入图片，设计流程图等，这样更符合提高工作效率的app定位。 4.能否增添一个笔记置顶的功能，比如为笔记本内内容生成了目录之后不能置顶也比较麻烦。', '#给印象笔记一些建议\n1.顶部的搜索框能否设置为可以自动选择搜索内容，比如搜索note还是搜索notebook；在notebook列表很多的时候搜索框只能搜notes还是有些鸡肋。 2.图片转文字的ocr功能能否设计为选择只保存文字，每次拍了照还有再多一步才能生成文字，然后插入后还要自己删除图片，实', '', 0, 4072, '2020-06-23 11:40:31', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (219, 115, 1, '', NULL, NULL, '想给石墨提两个建议：1 希望夜间模式能放到编辑页面的菜单栏里，不然切换的时候还要先退出去，再点两下，有点不友好；2 希望iPad版本能增加一个调整显示比例的功能（不用太精细），我视力不太好，现在字体的大小看着有点吃力，而边距留白又比较多，感觉不是太舒适。嗯，希望做得更好，加油！', '想给石墨提两个建议：1 希望夜间模式能放到编辑页面的菜单栏里，不然切换的时候还要先退出去，再点两下，有点不友好；2 希望iPad版本能增加一个调整显示比例的功能（不用太精细），我视力不太好，现在字体的大小看着有点吃力，而边距留白又比较多，感觉不是太舒适。嗯，希望做得更好，加油！', '', 0, 4061, '2020-06-23 11:44:44', '2020-07-18 11:37:42', NULL);
