INSERT INTO `fb_posts_copy1` VALUES (222, 117, 1, '', NULL, NULL, '#狐妖小红娘手游# \n难受，刚回来玩儿就遇到bug？\n问题描述：《狐妖小红娘》手游，QQ互通6服，主线剧情需要升14级，升级途径如图1所述，完成王权与前尘忆梦的白尾红霞。但是问题来了，王权我已经完成了，可这个前尘忆梦白尾红霞我是真没这条支线任务，而且整个游戏界面找遍了也没找到上哪里接取。世界频道问过之后，发现有与我碰到同样问题的小伙伴，但是上午在游戏里反映过了到现在还没有解决，客服小姐姐能看到我们的反馈吗？', '#狐妖小红娘手游# \n难受，刚回来玩儿就遇到bug？\n问题描述：《狐妖小红娘》手游，QQ互通6服，主线剧情需要升14级，升级途径如图1所述，完成王权与前尘忆梦的白尾红霞。但是问题来了，王权我已经完成了，可这个前尘忆梦白尾红霞我是真没这条支线任务，而且整个游戏界面找遍了也没找到上哪里接取。世界频道问过', '', 0, 3987, '2020-06-23 19:22:58', '2020-07-18 11:37:42', NULL);
