INSERT INTO `fb_posts_copy1` VALUES (244, 70, 1, '', NULL, NULL, '吹爆番茄TODO，真的非常实用了，学习效率得到了显著提高，而且这个画风我真的爱了。不过希望开发者能加一个功能：代办完成后就直接消失，而不是等到第二天消失。这个可以加到设置中让用户自己选择（个人意见，这样能更清晰的看到没有完成的事项，而且看到代办清零时会有很大的成就感）。希望采纳建议，谢谢！', '吹爆番茄TODO，真的非常实用了，学习效率得到了显著提高，而且这个画风我真的爱了。不过希望开发者能加一个功能：代办完成后就直接消失，而不是等到第二天消失。这个可以加到设置中让用户自己选择（个人意见，这样能更清晰的看到没有完成的事项，而且看到代办清零时会有很大的成就感）。希望采纳建议，谢谢！', '', 0, 3733, '2020-06-27 13:21:25', '2020-07-18 11:37:42', NULL);
