INSERT INTO `fb_posts_copy1` VALUES (251, 113, 1, '', NULL, NULL, '#关于我的世界闪退问题\n我的世界总是会闪退，我的内存很大所以不存在内存小的问题，这种事情发生了无数次在我身边了真的，每次徒手一个人造的城市，辛辛苦苦造的存档一次次丢失，每一次心都碎了，我现在已经进不去了，删掉重下存档又会没掉，怎么办啊？就不能删掉重下还有之前的存档吗？那倒是优化一下啊……真的我服了啊，内容很好但我近两年来的心血就要这么没了？本来就当发布存档了，你突然告诉我进不去了，这次再丢失那我真的永远不会玩网易mc了，希望网易能看到解决一下🙏', '#关于我的世界闪退问题\n我的世界总是会闪退，我的内存很大所以不存在内存小的问题，这种事情发生了无数次在我身边了真的，每次徒手一个人造的城市，辛辛苦苦造的存档一次次丢失，每一次心都碎了，我现在已经进不去了，删掉重下存档又会没掉，怎么办啊？就不能删掉重下还有之前的存档吗？那倒是优化一下啊……真的我服了啊', '', 0, 3649, '2020-06-28 12:46:56', '2020-07-18 11:37:42', NULL);
