INSERT INTO `fb_posts_copy1` VALUES (272, 49, 1, '', NULL, NULL, '小红书搜索引擎太差了，急需要提升，麻烦团队赶紧提升一下吧。 搜关键字，经常出现不相关的内容，尤其是两个关键词以及以上的，基本上搜不出来想要的内容，点开最多只有出现一个关键词，甚至一个都没有。。。而且我关键词是地点+别的，居然经常忽略了我的地点，把其他城市的内容排在前面，就很莫名其妙，还要自己往下翻看看哪个是我要的城市的内容。', '小红书搜索引擎太差了，急需要提升，麻烦团队赶紧提升一下吧。 搜关键字，经常出现不相关的内容，尤其是两个关键词以及以上的，基本上搜不出来想要的内容，点开最多只有出现一个关键词，甚至一个都没有。。。而且我关键词是地点+别的，居然经常忽略了我的地点，把其他城市的内容排在前面，就很莫名其妙，还要自己往下翻看', '', 0, 3342, '2020-06-30 09:48:12', '2020-07-18 11:37:42', NULL);
