INSERT INTO `fb_posts_copy1` VALUES (276, 65, 1, '', NULL, NULL, '首先猿题库非常棒是肯定的，目前还没有看到其他比较好的同类软件，有几点建议：1.刷题的时候可以设置题目类型，比如选择题，多选题填空什么的，因为每个地区试卷构成和题型都不一样，我们老师就建议不要写多选等无关题型。添加这个功能可以帮我们有针对性的应对考试等等，像教师版就已经有了筛选选项。2.成语PK可否像单词排位赛那样，在宣布结果时显示错题和成语释义？由于没有记录，比赛过程中的一些错误还是错误，没有纠正的机会，希望小猿予以改进。3.如果可能的话，添加一些月考的试卷类型。每次准备月考时打开猿题库都会有些不知要干嘛…… 以上是我对猿题库的一些小建议，希望小猿越办越好！', '首先猿题库非常棒是肯定的，目前还没有看到其他比较好的同类软件，有几点建议：1.刷题的时候可以设置题目类型，比如选择题，多选题填空什么的，因为每个地区试卷构成和题型都不一样，我们老师就建议不要写多选等无关题型。添加这个功能可以帮我们有针对性的应对考试等等，像教师版就已经有了筛选选项。2.成语PK可否像', '', 0, 3319, '2020-06-30 17:08:56', '2020-07-18 11:37:42', NULL);
