INSERT INTO `fb_posts_copy1` VALUES (281, 77, 1, '', NULL, NULL, '#给闲鱼提一些痛点，看能否改善\r\n1.对于买卖家而言，最大的问题还是在邮费上。因为邮费都自负，所以有时候包邮过去，一旦被退货的话，双方都是什么都没得到，还搭了邮费，心里都跟不爽。 2.对于小批量的零碎物品出售或许不错，但是想大量集中清理二手物品，能否提供可靠的第三方收购商或是自营的方式，替用户一次性清理掉二手物品，而且价格公道。 3.建议增加爱心捐赠，可以由快递员或是外卖员等上门回收，捐赠书籍，衣物等，给需要的贫困地区或是厂家，减少浪费。谢谢能被采纳～', '#给闲鱼提一些痛点，看能否改善\r\n1.对于买卖家而言，最大的问题还是在邮费上。因为邮费都自负，所以有时候包邮过去，一旦被退货的话，双方都是什么都没得到，还搭了邮费，心里都跟不爽。 2.对于小批量的零碎物品出售或许不错，但是想大量集中清理二手物品，能否提供可靠的第三方收购商或是自营的方式，替用户一次性', '', 0, 4, '2020-07-01 09:30:51', '2020-07-01 09:36:26', '2020-07-01 09:36:26');
