INSERT INTO `fb_posts_copy1` VALUES (285, 14, 1, '', NULL, NULL, '使用one app的问题\n一、我想知道的是为何没有微博的登陆入口了，以前的记录都保存在那里了。能给个解释嘛？ 二、无疑，新版改版之后，给人清爽的感觉。。但是排版却不是很好。比如首页，更期待的是图片，而不是图片接着一连串的文章，如果这样了，干嘛还要阅读那个栏目。 三、还有就是，一天的推荐量太大了，这不是一个了，而是一类了，虽然了解你们给我们更多的选择，给写作人、音乐人更多展示才华的机会。但代价是，一切都显得冗余了。一个似乎变得越来越不纯粹了。四、我们只是想停留一会，而你们却野心勃勃，要搞定一天的内容量，估计没有一个多小时是拿不下来的。', '使用one app的问题\n一、我想知道的是为何没有微博的登陆入口了，以前的记录都保存在那里了。能给个解释嘛？ 二、无疑，新版改版之后，给人清爽的感觉。。但是排版却不是很好。比如首页，更期待的是图片，而不是图片接着一连串的文章，如果这样了，干嘛还要阅读那个栏目。 三、还有就是，一天的推荐量太大了，这不', '', 0, 3238, '2020-07-02 11:34:06', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (286, 84, 1, '', NULL, NULL, '给卧卧app赞一个\n首先必须要夸夸卧卧的举报，在举报剧透、引战等弹幕时一般当天就能处理，非常高效用心！ 但也有一些问题： 1.更新后的页面 更新后的页面虽然分类更加仔细，但是查看起来也很麻烦。希望能把页面稍微合并、精简一下。 2.希望能在客户端上投稿！ 每次投稿都要上网页版qwq，还要提前先删掉客户端，这样感觉很不方便……希望卧卧能够在客户端投稿！ 最后祝卧卧越做越好、越做越顺！ 哇，真的出了客户端投稿欸！亲亲这个卧卧空间站！', '给卧卧app赞一个\n首先必须要夸夸卧卧的举报，在举报剧透、引战等弹幕时一般当天就能处理，非常高效用心！ 但也有一些问题： 1.更新后的页面 更新后的页面虽然分类更加仔细，但是查看起来也很麻烦。希望能把页面稍微合并、精简一下。 2.希望能在客户端上投稿！ 每次投稿都要上网页版qwq，还要提前先删掉客户', '', 0, 3228, '2020-07-02 16:23:44', '2020-07-18 11:37:42', NULL);
