INSERT INTO `fb_posts_copy1` VALUES (301, 59, 1, '', NULL, NULL, '@生存竞赛\n游戏挺好玩的，下面是我的一些建议：\n建议键位能够调整，捡东西经常按到手雷\n经验目前没什么用以后可以出个系统，用经验买枪皮肤挺好的\n可以每个人头上加个血条区分颜色，队友老是乱打\n狙击枪可以开镜，长按倍数逐渐增加，移动速度越来越慢，精确度提高\n烟雾弹的烟雾太卡了。。。\nokk，就这些希望看看趴(ಡωಡ)', '@生存竞赛\n游戏挺好玩的，下面是我的一些建议：\n建议键位能够调整，捡东西经常按到手雷\n经验目前没什么用以后可以出个系统，用经验买枪皮肤挺好的\n可以每个人头上加个血条区分颜色，队友老是乱打\n狙击枪可以开镜，长按倍数逐渐增加，移动速度越来越慢，精确度提高\n烟雾弹的烟雾太卡了。。。\nokk，就这些希望看看', '', 0, 3128, '2020-07-05 12:28:27', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (302, 41, 1, '', NULL, NULL, '无尽洪荒游戏有点问题啊。\n1，游戏节奏太慢了，基本属于十分钟搞定一切，其他时间就是个机器人，一直合成，然后等材料，再合成，而且那个特殊合成有些问题，天籁石只有氪金有，但是目前没办法氪金，只能眼巴巴看着，我那一堆绿色特殊合不了，可以考虑改为有一定爆率，低没事，起码有办法得到。\n2，宝箱有问题，时间跨度太长了，十几个小时。。。。我看到那个灵符只能提供五分钟，整个宝箱十六个小时的时候，内心崩了。刷图所有的大型收益，全部只能在十几个小时后提现，太难了，虽然有黄金代替开启，但是嘛，不划算。\n3，这时候就是优点了，游戏还是挺好的，在现在的内测版，一百五十黄金，基本够你点击下经验喝装备获取提升。游戏不大的情况下，可以做到这么多，其实挺不错的，而且界面简洁，特别喜欢。\n4，不过那个灵根有点问题，我用特殊材料和普通材料升的一模一样，不太好，建议改一下，特殊材料会随机出现特殊属性，灵根随机化可以使的游戏可玩性增加。', '无尽洪荒游戏有点问题啊。\n1，游戏节奏太慢了，基本属于十分钟搞定一切，其他时间就是个机器人，一直合成，然后等材料，再合成，而且那个特殊合成有些问题，天籁石只有氪金有，但是目前没办法氪金，只能眼巴巴看着，我那一堆绿色特殊合不了，可以考虑改为有一定爆率，低没事，起码有办法得到。\n2，宝箱有问题，时间跨度', '', 0, 3123, '2020-07-06 11:59:04', '2020-07-18 11:37:42', NULL);
INSERT INTO `fb_posts_copy1` VALUES (303, 49, 1, '', NULL, NULL, '@男鹿和彦，关于游戏的几点建议：\n1.既然有猎物跟踪视角 那么我希望也有人物跟踪视角 这样我就不用一直滑动屏幕调整面相了 尤其是我准备猎杀一群双足亚龙的时候（手动滑稽\n2.希望地图上能显示人物和怪物的面相\n3.希望能调整视距 有时候我真的希望我能看到整个炎晶龙的雄伟的躯体 而不是看着他的脚趾……\n4.地图上再少些空气墙那就太好了！\n5.自动导航的路线可以优化一下 圆润点或许更好呢。', '@男鹿和彦，关于游戏的几点建议：\n1.既然有猎物跟踪视角 那么我希望也有人物跟踪视角 这样我就不用一直滑动屏幕调整面相了 尤其是我准备猎杀一群双足亚龙的时候（手动滑稽\n2.希望地图上能显示人物和怪物的面相\n3.希望能调整视距 有时候我真的希望我能看到整个炎晶龙的雄伟的躯体 而不是看着他的脚趾……\n4', '', 0, 3121, '2020-07-06 12:18:46', '2020-07-18 11:37:42', NULL);
