INSERT INTO `fb_posts_copy1` VALUES (307, 45, 1, '', NULL, NULL, '学霸君老师答疑需要改进啊！\n首先老师答疑的功能还是挺不错的，但是收费太高了，而且老师水平得不到保证，一些腼腆的同学也不习惯跟陌生的老师直接通话。希望君君以后可以稍微下调答疑费用，毕竟这个价钱都可以赶上补习班了。况且老师答疑只能解决个别的题目，而不能像补习班一样系统的提升，因此价钱不宜太高！', '学霸君老师答疑需要改进啊！\n首先老师答疑的功能还是挺不错的，但是收费太高了，而且老师水平得不到保证，一些腼腆的同学也不习惯跟陌生的老师直接通话。希望君君以后可以稍微下调答疑费用，毕竟这个价钱都可以赶上补习班了。况且老师答疑只能解决个别的题目，而不能像补习班一样系统的提升，因此价钱不宜太高！', '', 0, 3102, '2020-07-06 14:21:50', '2020-07-18 11:37:42', NULL);
