INSERT INTO `fb_posts_copy1` VALUES (440, 258, 1, '', NULL, NULL, '长得很漂亮/很帅是一种什么样的体验？\n有一个很漂亮的女朋友/很帅的男朋友是什么体验？\n有一个富二代的朋友是一种什么样的体验？\n娱乐圈有哪些不为人知的故事？\n富二代的生活是什么样的？\n二十几岁年薪百万是什么样的体验？\n。。。\n说的是你，知乎。请问你的初心了？有问题，上知乎。我们老用户希望手机有一个百科平台，有一个一群人共同讨论某件事情，各抒己见的社区。而不是贩卖焦虑和虚荣的知乎！如今确实是快餐时代，但是我们仍然希望知乎能不忘初心，坚持输出干货，而不是毒鸡汤。', '长得很漂亮/很帅是一种什么样的体验？\n有一个很漂亮的女朋友/很帅的男朋友是什么体验？\n有一个富二代的朋友是一种什么样的体验？\n娱乐圈有哪些不为人知的故事？\n富二代的生活是什么样的？\n二十几岁年薪百万是什么样的体验？\n。。。\n说的是你，知乎。请问你的初心了？有问题，上知乎。我们老用户希望手机有一个百科', '', 0, 1586, '2020-07-13 17:35:30', '2020-07-18 11:37:42', NULL);
