INSERT INTO `fb_posts_copy1` VALUES (469, 328, 1, '', NULL, NULL, '发馈下一款新游戏 光遇 的体验吧。\n总体来说是个好游戏，应该是倾注了心血的，但是问题也很突出！首先就是刚发布的游戏可能是为了吸引用户，预约人数和实际下载不一样，而且服务器是个大坑，经常会崩溃。其次，排队时间实在是太长了，十几分钟都算是好的了，有时甚至要半小时！\n内容感觉和风之旅有点像，但是略微低配，音乐声音也稍稍逊色。\n总之，还是感谢小陈的制作吧！', '发馈下一款新游戏 光遇 的体验吧。\n总体来说是个好游戏，应该是倾注了心血的，但是问题也很突出！首先就是刚发布的游戏可能是为了吸引用户，预约人数和实际下载不一样，而且服务器是个大坑，经常会崩溃。其次，排队时间实在是太长了，十几分钟都算是好的了，有时甚至要半小时！\n内容感觉和风之旅有点像，但是略微低配，', '', 0, 1313, '2020-07-14 14:27:38', '2020-07-18 11:37:42', NULL);
